INSERT INTO `comments` (`id`, `name`, `descrip`, `content`, `image`, `created_at`, `updated_at`) VALUES
(1,	'Jacob Joshua',	'Chief Manager',	'Embrace really nails it! Creative brilliance, approachable style. They\'re the partners you want—artistry meets strategy. Thrilled with what they achieved!\"',	'comments/65d3e601e697f.png',	'2024-02-14 21:12:13',	'2024-02-20 03:36:33'),
(2,	'Kate Addams',	'Chief Manager',	'I found the digital expertise I needed. Their creative-professional balance exceeded expectations. Friendly interactions, exceptional outcomes. For digital enchantment, it\'s got to be Embrace!',	'comments/65d3e60ad41e4.png',	'2024-02-14 21:14:04',	'2024-02-20 03:36:42'),
(3,	'Amelia Joseph',	'Chief Manager',	'My vision came alive effortlessly. Their blend of casual and professional approach made the process a breeze. Creativity flowed, and the results were beyond my expectations.',	'comments/65d3e6143300a.png',	'2024-02-14 21:16:21',	'2024-02-20 03:36:52');
