INSERT INTO `faq` (`id`, `title`, `content`, `created_at`, `updated_at`) VALUES
(7,	'What languages does Skylingua offer courses in?',	'Skylingua.net offers a diverse range of language courses including, but not limited to, English, Spanish, French, Italian, Japanese, Portuguese, Chinese, Arabic, Turkish. Our course offerings are continuously expanding to include more languages from aroun',	'2024-02-20 09:37:54',	'2024-02-20 09:37:54'),
(8,	'How do I choose the right course for my language level?',	'Skylingua.net provides a comprehensive assessment to determine your current language level and recommend the most suitable course for you. You can also consult with our language advisors to make an informed decision.',	'2024-02-20 09:38:20',	'2024-02-20 09:38:20'),
(9,	'How can I enroll in a Skylingua course?',	'Enrollment is simple! Just visit our website, choose your desired language, and follow the prompts to register.',	'2024-02-20 09:38:47',	'2024-02-29 12:42:20'),
(10,	'Can I access courses on mobile devices?',	'Yes, Skylingua courses are designed to be fully accessible on various devices, including smartphones, tablets, and computers, ensuring you can learn anytime, anywhere.',	'2024-02-20 09:39:30',	'2024-02-20 09:39:30'),
(11,	'What does a typical Skylingua course include?',	'Each course includes interactive lessons, multimedia content, practice exercises, and assessments. Additionally, you\'ll have access to cultural insights, live tutoring sessions, and a community forum for extra practice.',	'2024-02-20 09:39:55',	'2024-02-20 09:39:55'),
(12,	'How long does it take to complete a language course?',	'Course duration varies depending on the language and level. Each course description on our website provides an estimated completion time. Remember, your pace can also affect how quickly you complete the course.',	'2024-02-20 09:40:28',	'2024-02-20 09:40:28'),
(13,	'What are the payment options for Skylingua courses?',	'Skylingua accepts various payment methods, including credit cards, and other online payment platforms. Secure payment options are detailed at checkout.',	'2024-02-20 09:40:49',	'2024-02-29 12:42:52');
