INSERT INTO `pages_translations` (`page_id`, `language_id`, `name`, `text`, `title`, `keyword`, `description`, `created_at`, `updated_at`) VALUES
(1,	1,	'Terms & Conditions',	'Terms &amp; Conditions<br /><br />Effective Date: 15.02.2024<br /><br />Welcome to Skylingua.net, the nexus where passion for languages meets the power of technology to connect freelance foreign language instructors with eager learners from every corner of the globe. In a world that grows more interconnected by the day, we are thrilled to offer a platform that not only bridges linguistic gaps but also fosters cultural understanding and exchange.<br /><br />These Terms &amp; Conditions are designed to clearly outline the legal agreement between you (the user, whether as a learner or instructor) and Skylingua.net, detailing your rights, obligations, and the limits of using our platform and services.<br /><br />By accessing or engaging with Skylingua.net, you enter into a binding legal agreement with us, signifying your acceptance of these Terms &amp; Conditions in their entirety. This agreement is critical—it not only governs your use of our platform but also protects your rights as a user and ours as a service provider. We encourage you to read these terms carefully, understand them fully, and consider their implications for your use of Skylingua.net.<br /><br />1.    Acceptance of Terms<br /><br />By using Skylingua.net, you confirm that you have read, understood, and agreed to these Terms &amp; Conditions. If you do not agree with any part of these terms, you must not use our platform.<br /><br />2.    Services Offered<br /><br />Skylingua.net provides a platform for freelance foreign language instructors to offer instructional services to learners. We facilitate the connection between instructors and learners, handle payment processing, and provide tools and resources for effective language learning.<br /><br />3.    User Accounts<br /><br />●    Registration: Users must register for an account to access certain features of the platform. You agree to provide accurate, current, and complete information during the registration process and to update such information to keep it accurate, current, and complete.<br />●    Account Responsibility: You are responsible for safeguarding your account password and for any activities or actions under your account. Skylingua.net is not liable for any loss or damage arising from your failure to comply with this obligation.<br /><br />4.    Use of Platform<br /><br />●    Compliance: Users agree to use the platform only for lawful purposes and in a way that does not infringe the rights of, restrict, or inhibit anyone else\'s use and enjoyment of Skylingua.net.<br />●    Content Ownership: Instructors retain ownership of the materials and content they upload to the platform but grant Skylingua.net a license to use, distribute, and display the content as part of our services.<br /><br />5.    Payment Terms<br /><br />●    Fees: Learners agree to pay the fees for courses as listed on the platform. Instructors agree to receive payment for their services minus a service fee retained by Skylingua.net, as detailed in our Pricing and Payment Structure.<br /><br />6. Payments Made outside the Platform<br />At Skylingua, our priority is to ensure a secure, transparent, and efficient transaction process for all users of our Teachers platform. To support this goal, we have established the following policy regarding payments made outside the platform:<br />By choosing to make a payment outside of the Skylingua platform, users acknowledge and accept the risk that there will be no opportunity for a refund through Skylingua, regardless of the circumstances. This policy is in place to protect the integrity of our transaction process and to discourage off-platform transactions that bypass our safeguards and support systems.<br />Conducting Safe Transactions: We recommend that all transactions be conducted within the Skylingua platform to benefit from our secure payment processing, transaction history records, and dedicated customer support. This not only ensures your financial security but also supports the continued development and improvement of the platform.<br />By using the Skylingua platform, you agree to adhere to this Payment Policy and understand the implications of engaging in External Payments. For more information on safe transaction practices or to report concerns, please contact our support team.<br /><br />7. External Agreements Between Students and Teachers<br />Skylingua provides a structured platform designed to facilitate clear and official communication between students and teachers. This environment ensures that all parties have access to a secure, transparent, and reliable means of interaction. To maintain this standard, the following policy applies to agreements made outside of the platform\'s official correspondence channels:<br />Non-Responsibility for External Agreements: Skylingua will not be held responsible for any agreements, arrangements, or understandings (\"External Agreements\") made between students and teachers that occur outside of the platform\'s designated chat and communication tools. Users who choose to engage in External Agreements do so at their own risk and without the endorsement, support, or protection of Skylingua.<br />Consequences of External Agreements: Any consequences, disputes, or issues arising from External Agreements will be the sole responsibility of the involved parties (student and teacher). Skylingua will not provide mediation, arbitration, or any form of dispute resolution for External Agreements and will not be liable for any loss, damage, or harm resulting from such arrangements.<br />Official Correspondence Channel: Users are strongly encouraged to keep all communication and agreements within the official Skylingua chat and correspondence tools. This ensures that your interactions are documented and supported by the platform in the event of any disputes or issues that may arise.<br />Reporting External Agreements: If you encounter any proposal or suggestion to agree outside of Skylingua\'s official channels, please report it immediately to our support team. Your vigilance helps us maintain a safe and accountable environment for all users.<br /><br />8. Intellectual Property Rights<br />The content on Skylingua.net, including text, graphics, logos, images, as well as the compilation thereof, and any software used on the site, is the property of Skylingua.net or its suppliers and protected by copyright and intellectual property laws.<br /><br />9. Termination<br /><br />Skylingua.net reserves the right to terminate your access to the platform without cause or notice, which may result in the forfeiture and destruction of all information associated with your account.<br /><br />10. Limitation of Liability<br /><br />Skylingua.net shall not be liable for any indirect, incidental, special, consequential or punitive damages, including without limitation, loss of profits, data, use, goodwill, or other intangible losses, resulting from your access to or use of or inability to access or use the platform.<br /><br />11. Changes to Terms &amp; Conditions<br /><br />We reserve the right to modify these terms at any time. We will provide notice of any significant changes to the terms and conditions by posting the new terms on our platform. <br />The landscape of digital services is always evolving, and so too may these Terms &amp; Conditions. We reserve the right to update or modify these terms at any time, in response to changes in our services, legal landscape, or user feedback. Such changes will be effective immediately upon posting on our site, and by continuing to use Skylingua.net after these updates, you agree to be bound by the revised terms.<br /><br />12. Navigating the Terms<br /><br />To help you navigate these Terms &amp; Conditions, we\'ve organized them into clear, understandable sections. You\'ll find information on how to use Skylingua.net responsibly, what you can expect from us, and what we expect from you. Whether you\'re here to teach, learn, or explore, these terms ensure that Skylingua.net remains a safe, respectful, and rewarding space for everyone involved.<br /><br />13. Contact Us<br /><br />If you have any questions about these Terms &amp; Conditions, please contact us at info@skylingua.net  <br /><br />By using Skylingua.net, you acknowledge that you have read these Terms &amp; Conditions and agree to be bound by them.',	'Terms & Conditions | Skylingua.net',	'Terms, Conditions',	'Terms & Conditions | Skylingua.net',	'2022-07-06 00:31:29',	'2024-03-18 14:38:54'),
(2,	1,	'Privacy Policy',	'<strong>Privacy Policy</strong><br />\r\n<p><strong>Effective Date: 15.02.2024<br /><br /></strong></p>\r\n<div style=\"text-align: justify;\"><span style=\"font-weight: 400;\">Welcome to Skylingua.net, where we are committed to protecting your privacy and ensuring the security of your personal information. This Privacy Policy outlines how we collect, use, disclose, and safeguard your information when you use our website, Skylingua.net, and the services offered through it.</span></div>\r\n<div style=\"text-align: justify;\"><span style=\"font-weight: 400;\">At Skylingua, we recognize the importance of maintaining the confidentiality of your data. We are dedicated to transparency in our data practices and strive to provide you with clear explanations of how we handle your information. By accessing or using Skylingua.net, you agree to the terms and practices outlined in this Privacy Policy.</span></div>\r\n<div style=\"text-align: justify;\"><span style=\"font-weight: 400;\">By accessing or using Skylingua.net and its related services, you acknowledge that you have read, understood, and agreed to the practices described in this Privacy Policy. Your trust is not something we take lightly. In return, we promise to continue evolving our privacy practices as technology and regulations change, ensuring that we remain at the forefront of data protection.<br /><br /><br /></span></div>\r\n<div style=\"text-align: justify;\">\r\n<ol>\r\n<li><strong> Collection of Information</strong></li>\r\n</ol>\r\n</div>\r\n<div style=\"text-align: justify;\"><span style=\"font-weight: 400;\"><br />At Skylingua.net, we collect information that supports our mission to deliver a personalized and efficient language learning journey. This includes:</span></div>\r\n<div style=\"text-align: justify;\">\r\n<ul>\r\n<li aria-level=\"1\"><span style=\"font-weight: 400;\">Personal Identification Information: Name, email address, and other contact details when you sign up, participate in our courses, or engage with our platform.</span></li>\r\n</ul>\r\n<ul>\r\n<li aria-level=\"1\"><span style=\"font-weight: 400;\">Payment Information: Secure collection of payment details for subscription services, managed through trusted third-party payment processors.</span></li>\r\n</ul>\r\n<ul>\r\n<li aria-level=\"1\"><span style=\"font-weight: 400;\">Performance and Usage Data: Information on how you interact with our services, including course progress, preferences, and feedback to enhance your learning experience.</span></li>\r\n</ul>\r\n<ul>\r\n<li aria-level=\"1\"><span style=\"font-weight: 400;\">Technical Information: IP addresses, browser types, and log data for improving website functionality and security.</span></li>\r\n</ul>\r\n<br />\r\n<ol start=\"2\">\r\n<li><strong> Use of Information</strong></li>\r\n</ol>\r\n</div>\r\n<div style=\"text-align: justify;\"><span style=\"font-weight: 400;\"><br />The information we collect is integral to providing you with a tailored learning experience. It enables us to:</span></div>\r\n<div style=\"text-align: justify;\">\r\n<ul>\r\n<li aria-level=\"1\"><span style=\"font-weight: 400;\">Customize your learning path and recommend relevant content.</span></li>\r\n</ul>\r\n<ul>\r\n<li aria-level=\"1\"><span style=\"font-weight: 400;\">Process transactions and maintain your account.</span></li>\r\n</ul>\r\n<ul>\r\n<li aria-level=\"1\"><span style=\"font-weight: 400;\">Communicate important updates, offers, and promotional content.</span></li>\r\n</ul>\r\n<ul>\r\n<li aria-level=\"1\"><span style=\"font-weight: 400;\">Improve and expand our services based on user feedback and usage patterns.</span></li>\r\n</ul>\r\n<ul>\r\n<li aria-level=\"1\"><span style=\"font-weight: 400;\">Ensure the overall security and integrity of our platform.</span></li>\r\n</ul>\r\n<br />\r\n<ol start=\"3\">\r\n<li><strong> Sharing and Disclosure</strong></li>\r\n</ol>\r\n</div>\r\n<div style=\"text-align: justify;\"><span style=\"font-weight: 400;\"><br />Skylingua.net is committed to not selling or renting your personal information to third parties. We may disclose your information if required by law or to protect the rights and safety of Skylingia.net, our users, or the public.<br /><br /></span></div>\r\n<div style=\"text-align: justify;\">\r\n<ol start=\"4\">\r\n<li><strong> Data Security</strong></li>\r\n</ol>\r\n</div>\r\n<div style=\"text-align: justify;\"><span style=\"font-weight: 400;\"><br />We implement a variety of security measures to maintain the safety of your personal information. While we strive to use commercially acceptable means to protect your personal information, no method of transmission over the Internet or method of electronic storage is 100% secure.<br /><br /></span></div>\r\n<div style=\"text-align: justify;\"><strong><br />5</strong><strong>. Instructor and Learner Information<br /></strong></div>\r\n<div style=\"text-align: justify;\"><span style=\"font-weight: 400;\">At Skylingua, we collect various types of information from both instructors and learners to enhance the educational experience and facilitate effective language learning. For instructors, this may include qualifications, teaching certifications, course materials, feedback, and ratings. Learner information may encompass language proficiency levels, learning preferences, course progress, participation in forums, and feedback on instructors. This information is utilized to match instructors with learners based on their specific needs, improve course offerings, and ensure the quality of instruction provided on the platform.<br /><br /></span></div>\r\n<div style=\"text-align: justify;\">\r\n<ol start=\"6\">\r\n<li><strong> Data Use in Educational Services</strong></li>\r\n</ol>\r\n</div>\r\n<div style=\"text-align: justify;\"><span style=\"font-weight: 400;\"><br />Purpose of Data Collection: Personal and performance data collected from instructors and learners are utilized to personalize the learning experience and provide targeted educational support. This includes tracking course progress, analyzing participation in forums, and evaluating assignment submissions to tailor instructional materials and methodologies to individual learning styles. Additionally, data analysis helps monitor the effectiveness of teaching methodologies, allowing us to continuously enhance the quality of education offered at Skylingua.</span></div>\r\n<div style=\"text-align: justify;\"><strong><br />7</strong><span style=\"font-weight: 400;\">. </span><strong>Communication Between Users<br /></strong></div>\r\n<div style=\"text-align: justify;\"><span style=\"font-weight: 400;\">Privacy in Communication: Skylingua facilitates communication between instructors and learners while prioritizing user privacy and safety. Communication data is handled securely, with measures in place to safeguard the confidentiality and integrity of user communications.<br /><br /></span></div>\r\n<div style=\"text-align: justify;\">\r\n<ol start=\"8\">\r\n<li><strong> Profiles and Portfolios</strong></li>\r\n</ol>\r\n</div>\r\n<div style=\"text-align: justify;\"><span style=\"font-weight: 400;\"><br />Instructors can manage their public profiles and portfolios on Skylingua, controlling the visibility of their information to other users or the public. While certain details such as qualifications and course offerings may be visible to all users, instructors have the option to limit the visibility of sensitive information. Additionally, users can control the visibility of their course reviews and feedback, balancing transparency with privacy preferences.<br /><br /></span></div>\r\n<div style=\"text-align: justify;\">\r\n<ol start=\"9\">\r\n<li><strong> Compliance with Education Data Protection Laws</strong></li>\r\n</ol>\r\n</div>\r\n<div style=\"text-align: justify;\"><span style=\"font-weight: 400;\"><br />We prioritize the protection of student records and information, implementing measures to ensure compliance with legal requirements and industry standards for educational data privacy and security.<br /><br /></span></div>\r\n<div style=\"text-align: justify;\">\r\n<ol start=\"10\">\r\n<li><strong> Data Security for Educational Platforms</strong></li>\r\n</ol>\r\n</div>\r\n<div style=\"text-align: justify;\"><span style=\"font-weight: 400;\"><br />Skylingua implements enhanced security measures to protect the sensitive nature of educational data. This includes encryption of communications, secure storage of educational materials, and access controls for instructors and learners. Additionally, we regularly update our security protocols to address emerging threats and maintain the confidentiality and integrity of educational data on our platform.<br /><br /></span></div>\r\n<div style=\"text-align: justify;\">\r\n<ol start=\"11\">\r\n<li><strong> Rights Related to Educational Data</strong></li>\r\n</ol>\r\n</div>\r\n<div style=\"text-align: justify;\"><span style=\"font-weight: 400;\"><br />Instructors and learners on Skylingua retain rights over their educational content, including copyrights and the ability to delete or port their course materials. Instructors have the discretion to manage the use of their educational content on the platform, while learners maintain control over their data and contributions. Our policies prioritize user rights and empower users to manage their educational content according to their preferences and legal obligations.<br /><br /></span></div>\r\n<div style=\"text-align: justify;\">\r\n<ol start=\"12\">\r\n<li><strong> Changes to This Privacy Policy</strong></li>\r\n</ol>\r\n</div>\r\n<div style=\"text-align: justify;\"><span style=\"font-weight: 400;\"><br />We may update our Privacy Policy from time to time. We encourage you to review this Privacy Policy periodically for any changes.<br /><br /></span></div>\r\n<div style=\"text-align: justify;\">\r\n<ol start=\"13\">\r\n<li><strong> Contact Us</strong></li>\r\n</ol>\r\n</div>\r\n<div style=\"text-align: justify;\"><span style=\"font-weight: 400;\"><br />If you have any questions or suggestions about our Privacy Policy, do not hesitate to contact us at </span><a href=\"mailto:info@skylingua.net\"><span style=\"font-weight: 400;\">info@skylingua.net</span></a><span style=\"font-weight: 400;\"> </span></div>',	'Privacy Policy | Skylingua.net',	'Privacy Policy',	'Privacy Policy | Skylingua.net',	'2022-07-06 00:31:54',	'2024-03-13 11:15:08'),
(4,	1,	'About Us',	'<p><span style=\"color: #ecf0f1;\">Step into Skylingia – where the world’s languages come alive and new possibilities emerge. Our platform is designed to break down linguistic barriers and create pathways for meaningful connections. With a global reach and a learner-centred focus, Skylingia transforms language learning into a personalized adventure.</span></p>\r\n<h3><span style=\"color: #ecf0f1;\">Our Vision</span></h3>\r\n<p><span style=\"color: #ecf0f1;\">We believe in the power of language to unite people and open doors. Our vision is simple: make language learning accessible, fun, and enriching for anyone eager to explore. At Skylingia, we’re here to help learners not just speak a new language, but truly engage with it, bringing the cultures and communities behind the words to life.</span></p>\r\n<h3><span style=\"color: #ecf0f1;\">How It All Began</span></h3>\r\n<p><span style=\"color: #ecf0f1;\">Skylingia was born from a love for languages and a desire to rethink how they’re learned. A group of language experts and educators came together with the idea of creating a platform where modern technology meets the rich, immersive experience of real-world learning. From that simple concept, a vibrant, global community has grown – one that celebrates both the diversity of languages and the joy of mastering them.</span></p>\r\n<h3><span style=\"color: #ecf0f1;\">What We Do</span></h3>\r\n<p><span style=\"color: #ecf0f1;\">At Skylingia, learning is all about you. Our approach blends cutting-edge tools with immersive methods that make mastering a language feel natural. Explore a wide range of courses that adapt to your pace, needs, and interests. From globally spoken languages like English and Spanish to the unique beauty of less common languages, Skylingia offers an open door to every corner of the linguistic world.</span></p>\r\n<h3><span style=\"color: #ecf0f1;\">Our People</span></h3>\r\n<p><span style=\"color: #ecf0f1;\">Behind every lesson is a dedicated educator, passionate about both their language and their students. Our team of language experts doesn’t just teach—they guide, inspire, and support each learner. With personalized instruction and deep cultural knowledge, they turn every session into a meaningful step toward fluency.</span></p>\r\n<h3><span style=\"color: #ecf0f1;\">Your Journey Awaits</span></h3>\r\n<p><span style=\"color: #ecf0f1;\">Learning a new language is more than just gaining a skill; it’s opening yourself up to new perspectives, cultures, and opportunities. Skylingia makes that journey easier, more engaging, and endlessly rewarding. No matter your reason for learning, we’re here to ensure you achieve your goals and enjoy the process along the way.</span></p>\r\n<p><span style=\"color: #ecf0f1;\">Let the adventure begin with Skylingia—because language has no limits.</span></p>',	'About Us | Skylingua.net',	'Skylingua.net',	'About Us | Skylingua.net',	'2022-08-11 02:15:37',	'2024-11-14 12:39:01'),
(5,	1,	'Cancellations & Refunds',	'<strong>Cancellations &amp; Refunds<br /><br />Effective Date: 15.02.2024<br /></strong><br />\r\n<div style=\"text-align: justify;\"><span style=\"font-weight: 400;\">Welcome to Skylingua.net, your premier online destination for learning and teaching languages. In the dynamic world of language education, we recognize that flexibility is key. There may be times when, despite your best intentions, you need to cancel a booked language course or request a refund. That\'s why we\'ve crafted our Cancellations &amp; Refunds Policy with care and consideration, aiming to protect and accommodate the interests and commitments of both our valued learners and dedicated freelance foreign language instructors.</span></div>\r\n<div style=\"text-align: justify;\"><span style=\"font-weight: 400;\"><br />This policy outlines the conditions under which cancellations and refunds are processed on Skylingua.net. It covers various scenarios, including but not limited to, last-minute cancellations, emergency withdrawals, and instructor-initiated course cancellations. Our aim is not just to lay down the rules but to also explain the reasoning behind them, fostering a community built on mutual respect and understanding.<br /><br /></span></div>\r\n<div style=\"text-align: justify;\"><strong>1 . Cancellations by Learners</strong></div>\r\n<div style=\"text-align: justify;\">\r\n<ul>\r\n<li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">Notice Period: Learners can cancel a booked course without penalty up to [24 hours] before the scheduled start time.</span></li>\r\n<li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">Late Cancellations: Cancellations made less than [24 hours] before the course start time will result in a charge of [%50], which compensates the instructor for their preparation and lost booking opportunity.</span></li>\r\n</ul>\r\n</div>\r\n<div style=\"text-align: justify;\"><strong><br />2. Cancellations by Instructors</strong></div>\r\n<div style=\"text-align: justify;\">\r\n<ul>\r\n<li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">Instructor Responsibility: Instructors are required to notify learners of a cancellation at least [48 hours] in advance, except in cases of emergency.</span></li>\r\n<li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">Replacement Sessions: In the event of a cancellation by an instructor, they should offer to reschedule the session at a mutually agreeable time.</span></li>\r\n</ul>\r\n</div>\r\n<div style=\"text-align: justify;\"> </div>\r\n<div style=\"text-align: justify;\">\r\n<ol start=\"3\">\r\n<li><strong> Refund Requests</strong></li>\r\n</ol>\r\n<ul>\r\n<li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">Eligibility: Refunds are considered on a case-by-case basis and are typically processed in the following scenarios:</span></li>\r\n</ul>\r\n<ul>\r\n<li style=\"font-weight: 400;\" aria-checked=\"false\" aria-level=\"1\"><span style=\"font-weight: 400;\">The instructor cancels a session without offering a suitable replacement.</span></li>\r\n<li style=\"font-weight: 400;\" aria-checked=\"false\" aria-level=\"1\"><span style=\"font-weight: 400;\">Technical issues from Skylingua.net\'s side significantly disrupt the session.</span></li>\r\n<li style=\"font-weight: 400;\" aria-checked=\"false\" aria-level=\"1\"><span style=\"font-weight: 400;\">A learner cancels within the permitted time frame as outlined in this policy.</span></li>\r\n</ul>\r\n</div>\r\n<div style=\"text-align: justify;\"><strong><br />4. Processing Refunds</strong></div>\r\n<div style=\"text-align: justify;\">\r\n<ul>\r\n<li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">Timing: Approved refunds will be processed within [</span><span style=\"font-weight: 400;\">7-10 business days</span><span style=\"font-weight: 400;\">]</span><span style=\"font-weight: 400;\"> business days and credited back to the original method of payment.</span></li>\r\n<li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">Partial Refunds: In certain cases, such as when a course is partially completed or if a late cancellation fee applies, only a partial refund may be issued.</span></li>\r\n</ul>\r\n</div>\r\n<div style=\"text-align: justify;\"><strong><br /><br />5. Non-refundable Circumstances</strong></div>\r\n<div style=\"text-align: justify;\">\r\n<ul>\r\n<li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">No-shows: Learners who fail to attend a scheduled course without prior notice are not eligible for a refund.</span></li>\r\n<li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">User Dissatisfaction: If the refund request is solely based on the user\'s dissatisfaction with the course content or teaching style, without any breach of the Terms &amp; Conditions by the instructor, such requests may be denied.</span></li>\r\n</ul>\r\n</div>\r\n<div style=\"text-align: justify;\"><strong><br />6. Dispute Resolution<br /><br /></strong></div>\r\n<div style=\"text-align: justify;\"><span style=\"font-weight: 400;\">In the event of a dispute regarding cancellations or refunds, Skylingua.net encourages direct resolution between the learner and the instructor. If an agreement cannot be reached, Skylingua.net will mediate to find a fair resolution based on the evidence provided by both parties.</span></div>\r\n<div style=\"text-align: justify;\"><strong><br />7. Policy Changes</strong></div>\r\n<div style=\"text-align: justify;\"> </div>\r\n<div style=\"text-align: justify;\"><span style=\"font-weight: 400;\">Skylingua.net reserves the right to modify this Cancellations &amp; Refunds Policy at any time. Any changes will be effective immediately upon posting the revised policy on our platform, and your continued use of our services constitutes your agreement to be bound by the revised policy. As Skylingua.net continues to grow and evolve, so too may our policies. We will communicate any changes to our Cancellations &amp; Refunds Policy promptly, keeping you informed and up to date. We invite you to review this policy periodically to stay informed about how we handle cancellations and refunds.</span></div>\r\n<div style=\"text-align: justify;\"><strong><br />8. Contact Us</strong></div>\r\n<div style=\"text-align: justify;\"> </div>\r\n<div style=\"text-align: justify;\"><span style=\"font-weight: 400;\">Should you have any questions or need further clarification about our Cancellations &amp; Refunds Policy, our customer support team is just an email or phone call away. We\'re here to ensure that your experience with Skylingua.net is not only educational but also supported every step of the way. For questions related to cancellations and refunds, or to submit a refund request, please contact us at </span><span style=\"font-weight: 400;\"> </span><a href=\"mailto:info@skylingua.net\"><span style=\"font-weight: 400;\">info@skylingua.net</span></a><span style=\"font-weight: 400;\"> </span><span style=\"font-weight: 400;\">  <br /><br /></span></div>\r\n<div style=\"text-align: justify;\"><span style=\"font-weight: 400;\">By using the services provided by Skylingua.net, you agree to this Cancellations &amp; Refunds Policy. We aim to provide a fair and transparent process to support the needs and rights of both our learners and instructors.</span></div>',	'Cancellations & Refunds | Skylingua.net',	'Cancellations, Refunds',	'Cancellations & Refunds | Skylingua.net',	'2022-10-03 12:40:41',	'2024-03-13 11:40:57'),
(6,	1,	'Complaints Policy',	'Last updated: September 2, 2022<br /><br /><strong>Complaints Policy</strong><br /><br />At Freework.world, we are committed to providing a platform where clients and freelancers can collaborate effectively and enjoy a positive experience. We understand that issues may occasionally arise, and we have established a transparent and fair complaint\'s policy to address any concerns you may have. Please take a moment to review our guidelines below:<br /><br /><strong>Open Communication:</strong><br /><br />We encourage open and respectful communication between clients and freelancers. If you encounter any problems or have concerns regarding a project or interaction, we recommend addressing the issue directly with the other party involved. Often, misunderstandings can be resolved through clear communication.<br /><br /><strong>Escalation Process:</strong><br /><br />If a resolution cannot be reached through direct communication, the following escalation process can be followed:<br /><br />1. <strong>Step 1: Direct Communication:</strong> As mentioned above, try to resolve the issue by discussing it directly with the other party involved. Keep all communication professional and respectful.<br /><br />2. <strong>Step 2: Contact Support:</strong> If the issue remains unresolved, you can reach out to our dedicated support team at info@freework.world. Provide detailed information about the situation, including any relevant communication and project details.<br /><br />3. <strong>Step 3: Mediation:</strong> Our support team will review the information provided and work as a neutral mediator to assist in finding a solution. We will strive to facilitate a fair resolution for all parties involved.<br /><br /><strong>Dispute Resolution:</strong><br /><br />In the event of a dispute that cannot be resolved through the above steps, Freework.world may offer dispute resolution services. Our team will carefully review all available information from both parties and make a judgment based on our policies and guidelines.<br /><br /><strong>Complaints against Freelancers:</strong><br /><br />If you are a client and have a complaint against a freelancer, we will investigate the issue thoroughly. This may involve reviewing project details, communication records, and any other relevant information. If the complaint is found to be valid, appropriate actions will be taken in accordance with our policies.<br /><br /><strong>Complaints against Clients:</strong><br /><br />If you are a freelancer and have a complaint against a client, we will similarly conduct a thorough investigation. We will consider project details, communication history, and other relevant factors. If the complaint is substantiated, we will take appropriate measures as outlined in our policies.<br /><br /><strong>Confidentiality:</strong><br /><br />We understand the importance of maintaining confidentiality throughout the complaint\'s resolution process. All parties involved are expected to treat any sensitive information with discretion and respect.<br /><br />Please note that our Complaints Policy is subject to change, and we may update it from time to time to ensure the best possible experience for all users. It\'s recommended that clients and freelancers review this page periodically to stay informed about any changes.<br /><br />For any questions or concerns regarding our Complaints Policy, please don\'t hesitate to contact our support team at info@freework.world.',	'Complaints Policy | FreeWork',	'Complaints Policy',	'Compliments and Complaints Policy ➤ Fortuna LTD is committed to providing a quality service and working in an open and accountable way.',	'2022-10-04 13:54:28',	'2023-08-02 16:52:52'),
(7,	1,	'Terms & Conditions',	'<strong>Terms &amp; Conditions<br /><br />Effective Date: 15.02.2024</strong>\r\n<div style=\"text-align: justify;\"><br />Welcome to Skylingua.net, the nexus where passion for languages meets the power of technology to connect freelance foreign language instructors with eager learners from every corner of the globe. In a world that grows more interconnected by the day, we are thrilled to offer a platform that not only bridges linguistic gaps but also fosters cultural understanding and exchange.</div>\r\n<div style=\"text-align: justify;\"><br />These Terms &amp; Conditions are designed to clearly outline the legal agreement between you (the user, whether as a learner or instructor) and Skylingua.net, detailing your rights, obligations, and the limits of using our platform and services.</div>\r\n<div style=\"text-align: justify;\">By accessing or engaging with Skylingua.net, you enter into a binding legal agreement with us, signifying your acceptance of these Terms &amp; Conditions in their entirety. This agreement is critical—it not only governs your use of our platform but also protects your rights as a user and ours as a service provider. We encourage you to read these terms carefully, understand them fully, and consider their implications for your use of Skylingua.net.<br /><br /></div>\r\n<div style=\"text-align: justify;\">\r\n<ol>\r\n<li><strong>Acceptance of Terms</strong></li>\r\n</ol>\r\n</div>\r\n<div style=\"text-align: justify;\"><br />By using Skylingua.net, you confirm that you have read, understood, and agreed to these Terms &amp; Conditions. If you do not agree with any part of these terms, you must not use our platform.<br /><br /></div>\r\n<div style=\"text-align: justify;\">\r\n<ol start=\"2\">\r\n<li><strong>Services Offered</strong></li>\r\n</ol>\r\n</div>\r\n<div style=\"text-align: justify;\"><br />Skylingua.net provides a platform for freelance foreign language instructors to offer instructional services to learners. We facilitate the connection between instructors and learners, handle payment processing, and provide tools and resources for effective language learning.<br /><br /></div>\r\n<div style=\"text-align: justify;\">\r\n<ol start=\"3\">\r\n<li><strong>User Accounts</strong></li>\r\n</ol>\r\n<ul>\r\n<li aria-level=\"1\">Registration: Users must register for an account to access certain features of the platform. You agree to provide accurate, current, and complete information during the registration process and to update such information to keep it accurate, current, and complete.</li>\r\n</ul>\r\n<ul>\r\n<li aria-level=\"1\">Account Responsibility: You are responsible for safeguarding your account password and for any activities or actions under your account. Skylingua.net is not liable for any loss or damage arising from your failure to comply with this obligation.</li>\r\n</ul>\r\n<br />\r\n<ol start=\"4\">\r\n<li><strong>Use of Platform</strong></li>\r\n</ol>\r\n<ul>\r\n<li aria-level=\"1\">Compliance: Users agree to use the platform only for lawful purposes and in a way that does not infringe the rights of, restrict, or inhibit anyone else\'s use and enjoyment of Skylingua.net.</li>\r\n</ul>\r\n<ul>\r\n<li aria-level=\"1\">Content Ownership: Instructors retain ownership of the materials and content they upload to the platform but grant Skylingua.net a license to use, distribute, and display the content as part of our services.</li>\r\n</ul>\r\n<br />\r\n<ol start=\"5\">\r\n<li><strong>Payment Terms</strong></li>\r\n</ol>\r\n<ul>\r\n<li aria-level=\"1\">Fees: Learners agree to pay the fees for courses as listed on the platform. Instructors agree to receive payment for their services minus a service fee retained by Skylingua.net, as detailed in our Pricing and Payment Structure.</li>\r\n</ul>\r\n<strong>6. Payments Made outside the Platform</strong>\r\n<p>At Skylingua, our priority is to ensure a secure, transparent, and efficient transaction process for all users of our Teachers platform. To support this goal, we have established the following policy regarding payments made outside the platform:</p>\r\n<p>By choosing to make a payment outside of the Skykingua platform, users acknowledge and accept the risk that there will be no opportunity for a refund through Skykingua, regardless of the circumstances. This policy is in place to protect the integrity of our transaction process and to discourage off-platform transactions that bypass our safeguards and support systems.</p>\r\n<p><strong>Conducting Safe Transactions</strong>: We recommend that all transactions be conducted within the Skykingua platform to benefit from our secure payment processing, transaction history records, and dedicated customer support. This not only ensures your financial security but also supports the continued development and improvement of the platform.</p>\r\n<p>By using the Skylingua platform, you agree to adhere to this Payment Policy and understand the implications of engaging in External Payments. For more information on safe transaction practices or to report concerns, please contact our support team.<br /><strong><br />7. External Agreements Between Students and Teachers</strong></p>\r\n<p>Skylingua provides a structured platform designed to facilitate clear and official communication between students and teachers. This environment ensures that all parties have access to a secure, transparent, and reliable means of interaction. To maintain this standard, the following policy applies to agreements made outside of the platform\'s official correspondence channels:</p>\r\n<p><strong>Non-Responsibility for External Agreements</strong>: Skylingua will not be held responsible for any agreements, arrangements, or understandings (\"External Agreements\") made between students and teachers that occur outside of the platform\'s designated chat and communication tools. Users who choose to engage in External Agreements do so at their own risk and without the endorsement, support, or protection of Skylingua.</p>\r\n<p><strong>Consequences of External Agreements</strong>: Any consequences, disputes, or issues arising from External Agreements will be the sole responsibility of the involved parties (student and teacher). Skylingua will not provide mediation, arbitration, or any form of dispute resolution for External Agreements and will not be liable for any loss, damage, or harm resulting from such arrangements.</p>\r\n<p><strong>Official Correspondence Channel</strong>: Users are strongly encouraged to keep all communication and agreements within the official Skylingua chat and correspondence tools. This ensures that your interactions are documented and supported by the platform in the event of any disputes or issues that may arise.</p>\r\n<p><strong>Reporting External Agreements</strong>: If you encounter any proposal or suggestion to agree outside of Skylingua\'s official channels, please report it immediately to our support team. Your vigilance helps us maintain a safe and accountable environment for all users.</p>\r\n<p><strong><br />8. Intellectual Property Rights</strong></p>\r\n</div>\r\n<div style=\"text-align: justify;\">The content on Skylingua.net, including text, graphics, logos, images, as well as the compilation thereof, and any software used on the site, is the property of Skylingua.net or its suppliers and protected by copyright and intellectual property laws.<br /><strong><br />9. Termination</strong></div>\r\n<div style=\"text-align: justify;\"><br />Skylingua.net reserves the right to terminate your access to the platform without cause or notice, which may result in the forfeiture and destruction of all information associated with your account.<br /><strong><br />10. Limitation of Liability</strong></div>\r\n<div style=\"text-align: justify;\"><br />Skylingua.net shall not be liable for any indirect, incidental, special, consequential or punitive damages, including without limitation, loss of profits, data, use, goodwill, or other intangible losses, resulting from your access to or use of or inability to access or use the platform.<br /><strong><br />11. Changes to Terms &amp; Conditions</strong></div>\r\n<div style=\"text-align: justify;\"><br />We reserve the right to modify these terms at any time. We will provide notice of any significant changes to the terms and conditions by posting the new terms on our platform. </div>\r\n<div style=\"text-align: justify;\">The landscape of digital services is always evolving, and so too may these Terms &amp; Conditions. We reserve the right to update or modify these terms at any time, in response to changes in our services, legal landscape, or user feedback. Such changes will be effective immediately upon posting on our site, and by continuing to use Skylingua.net after these updates, you agree to be bound by the revised terms.<br /><strong><br />12. Navigating the Terms</strong></div>\r\n<div style=\"text-align: justify;\"><br />To help you navigate these Terms &amp; Conditions, we\'ve organized them into clear, understandable sections. You\'ll find information on how to use Skylingua.net responsibly, what you can expect from us, and what we expect from you. Whether you\'re here to teach, learn, or explore, these terms ensure that Skylingua.net remains a safe, respectful, and rewarding space for everyone involved.<br /><strong><br />13. Contact Us</strong></div>\r\n<div style=\"text-align: justify;\"><br />If you have any questions about these Terms &amp; Conditions, please contact us at <a href=\"mailto:info@skylingua.net\">info@skylingua.net</a> <br /><br /></div>\r\n<div style=\"text-align: justify;\">By using Skylingua.net, you acknowledge that you have read these Terms &amp; Conditions and agree to be bound by them.</div>',	NULL,	NULL,	NULL,	'2024-03-18 12:45:14',	'2024-03-18 14:36:37');
