(88,	91,	NULL,	20,	'Case studies',	NULL,	2,	40.00,	NULL,	NULL,	NULL,	'',	'{\"0\":null}',	NULL,	'&lt;p&gt;&lt;strong&gt;Welcome to my Creative Lab.&nbsp;&lt;br /&gt;&lt;br /&gt;&lt;/strong&gt;I will tap into my creative self to craft a compelling and engaging case study for your site.&lt;br /&gt;&lt;br /&gt;&lt;strong&gt;You will get content ready:&nbsp;&lt;/strong&gt;&lt;/p&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;Proofed and Edited&lt;/li&gt;\r\n&lt;li&gt;Highly professional and researched&lt;/li&gt;\r\n&lt;li&gt;Tailored to your website/business needs&lt;/li&gt;\r\n&lt;li&gt;SEO optimized w/strategic keywords&lt;/li&gt;\r\n&lt;/ul&gt;\r\n&lt;p&gt;&lt;strong&gt;My research spheres:&lt;/strong&gt;&lt;/p&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;Crypto &amp;amp; Blockchain&lt;/li&gt;\r\n&lt;li&gt;Real Estate&lt;/li&gt;\r\n&lt;li&gt;Consumer Goods&lt;/li&gt;\r\n&lt;li&gt;Tech &amp;amp; Innovation&lt;br /&gt;&lt;br /&gt;&lt;strong&gt;Why me:&nbsp;&lt;/strong&gt;&lt;/li&gt;\r\n&lt;/ul&gt;\r\n&lt;em&gt;I deliver a 24/7 hour support&lt;/em&gt;&lt;br /&gt;&lt;em&gt;I do a quick response to your questions&lt;/em&gt;&lt;br /&gt;&lt;em&gt;Quality work with references&lt;/em&gt;&lt;br /&gt;&lt;em&gt;FREE Turnitin Report&lt;/em&gt;&lt;br /&gt;&lt;em&gt;Free proofreading and editing of your work&lt;/em&gt;',	0,	0,	'2023-07-07 17:07:33',	'2024-02-20 00:00:00'),
(105,	167,	NULL,	20,	'Case Studies',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'',	'{\"0\":null}',	NULL,	'&lt;p&gt;&lt;strong&gt;Well-crafted Case Studies improve conversion and corporate image &amp;amp; reputation!&lt;/strong&gt;&lt;/p&gt;\r\n&lt;p&gt;&lt;strong&gt;You will get content:&lt;/strong&gt;&lt;/p&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;Proofed and Edited&lt;/li&gt;\r\n&lt;li&gt;Highly professional and researched&lt;/li&gt;\r\n&lt;li&gt;Tailored to your website/business needs&lt;/li&gt;\r\n&lt;li&gt;SEO optimized w/strategic keywords&lt;/li&gt;\r\n&lt;/ul&gt;\r\n&lt;p&gt;&lt;strong&gt;Strongest Areas:&lt;/strong&gt;&lt;/p&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;Crypto &amp;amp; Blockchain&lt;/li&gt;\r\n&lt;li&gt;Real Estate&lt;/li&gt;\r\n&lt;li&gt;Consumer Goods&lt;/li&gt;\r\n&lt;li&gt;Tech &amp;amp; Innovation&lt;/li&gt;\r\n&lt;li&gt;Fashion&lt;/li&gt;\r\n&lt;li&gt;Among many others.&lt;/li&gt;\r\n&lt;/ul&gt;\r\n&lt;p&gt;Through my creativity, industry research and brainstorming process sparked from the basic information, you will have the content your site deserves.&lt;br /&gt;&lt;br /&gt;&lt;strong&gt;Our company offers a wide array of professional copywriting services:&lt;/strong&gt;&lt;/p&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;Ad Copy&lt;/li&gt;\r\n&lt;li&gt;Email Copy&lt;/li&gt;\r\n&lt;li&gt;Press Releases&lt;/li&gt;\r\n&lt;li&gt;Blog Articles&lt;/li&gt;\r\n&lt;li&gt;eBooks&lt;/li&gt;\r\n&lt;li&gt;Web Content&lt;/li&gt;\r\n&lt;li&gt;Product Descriptions&lt;/li&gt;\r\n&lt;li&gt;Resume &amp;amp; Cover Letters&lt;/li&gt;\r\n&lt;li&gt;Micro Copy &amp;amp; UX&lt;/li&gt;\r\n&lt;li&gt;Several Pro Consulting Services&lt;/li&gt;\r\n&lt;/ul&gt;',	5,	0,	'2023-07-12 18:20:00',	'2024-02-20 00:00:00');
