(227,	'Hurriya',	1704,	NULL,	5.00,	'I want to express my immense gratitude to my Spanish tutor, David! He helped me prepare for the exam in the shortest possible time. His teaching method was effective and efficient. Thanks to his professionalism and patience, I was able to pass the exam with a high score. I recommend David to anyone who strives to succeed in learning Spanish!',	1,	'2024-07-30 18:40:16',	'2024-07-30 18:40:16'),
(228,	'Teigue',	1704,	NULL,	2.00,	'The specialist conducts the sessions poorly.',	1,	'2024-07-30 18:42:00',	'2024-07-30 18:42:00'),
(229,	'Hektor Montgomery',	1704,	NULL,	4.00,	'We had a trial lesson, and I think the specialist will be a perfect fit for someone! I would appreciate more attention to needs and goals, but I didn\'t make it to the second lesson as I got sick :(',	1,	'2024-07-30 18:43:53',	'2024-07-30 18:43:53'),
(230,	'Maccius',	1680,	NULL,	5.00,	'Very accessible, concise, and friendly. A good amount of material. A true professional.',	1,	'2024-07-30 18:50:20',	'2024-07-30 18:50:20'),
(231,	'Shina Sakata',	1680,	NULL,	5.00,	'She was excellent in helping improve my conversational skills, providing many contemporary expressions that aren\'t in textbooks. She was always accommodating in difficult moments and helped clarify challenging grammar. Very positive and warm in her communication. I will most likely seek her services again in the future.',	1,	'2024-07-30 18:54:03',	'2024-07-30 18:54:03'),
(232,	'Putra Craig',	1680,	NULL,	2.00,	'I would like to share my negative experience working with Sophie. She turned out to be a poor teacher who was unable to effectively help me learn Spanish. The instructor did not listen to my needs and did not tailor the lessons to address my weak areas, nor did she help me develop skills in the necessary areas.',	1,	'2024-07-30 18:58:12',	'2024-07-30 18:58:12'),
(233,	'Judy',	1680,	NULL,	4.00,	'The handouts were top-notch, no complaints there. However, there was a lack of engagement, and for some reason, only half of the face was visible during the lessons))))))',	1,	'2024-07-30 19:01:29',	'2024-07-30 19:01:29'),
(234,	'Callie',	1680,	NULL,	5.00,	'I studied with Sophie for a few months (I needed to recall a few things and get used to Spanish pronunciation in a short time). Sophie helped me a lot with all my tasks, explained everything well, and demonstrated clearly. Thank you!',	1,	'2024-07-30 19:04:01',	'2024-07-30 19:04:01'),
(235,	'Vindex Calderon',	1702,	NULL,	5.00,	'Excellent teacher!\r\nI\'m no longer taking lessons, but I was very satisfied with them.\r\nThank you very much!',	1,	'2024-07-30 19:09:36',	'2024-07-30 19:09:36'),
(236,	'Priam Granwall',	1702,	NULL,	4.00,	'A wonderful teacher, but unfortunately, due to life circumstances, the proposed lesson conditions are not satisfactory.',	1,	'2024-07-30 19:11:37',	'2024-07-30 19:11:37'),
(237,	'Olganos',	1702,	NULL,	5.00,	'The best teacher. Detailed explanations, individual approach. Lessons are varied and always interesting. Thank you very much!',	1,	'2024-07-30 19:20:51',	'2024-07-30 19:20:51'),
(238,	'Gaius Levy',	1702,	NULL,	5.00,	'I\'ve been studying with Brian for some time now, and I had previous experience with Japanese courses and other teachers. The result is amazing; I feel progress that I hadn\'t seen in a year and a half with other specialists. I\'ve started reading kanji. He explains the topics and kanji clearly. Brian is an excellent specialist and a wonderful person! Lessons with Brian are a pleasure! My enthusiasm for learning the language keeps growing, and that is undoubtedly thanks to this teacher!',	1,	'2024-07-30 21:17:46',	'2024-07-30 21:17:46'),
(239,	'Ichiro Odzava',	1702,	NULL,	5.00,	'We are very grateful to Brian for such productive lessons and his understanding and patient attitude!',	1,	'2024-07-30 21:26:50',	'2024-07-30 21:26:50'),
(240,	'Noelle',	1681,	NULL,	5.00,	'Excellent teacher, responsible attitude towards the lessons. It\'s a pity I couldn\'t continue for long due to my busy schedule.',	1,	'2024-07-30 21:37:42',	'2024-07-30 21:37:42'),
(241,	'Christoforos',	1681,	NULL,	5.00,	'Filip is a highly qualified and experienced teacher. When studying a language at higher levels and preparing for exams, qualities such as professionalism, a pedagogical approach, and psychological support are very important. Thanks to our lessons, I was able to prepare for a Japanese language interview in a very short time. I appreciated how quickly Filip understood what I wanted to say and helped me craft speeches/sentences that better reflected my thoughts than my own expressions and sounded extremely professional.',	1,	'2024-07-30 21:41:26',	'2024-07-30 21:41:26'),
(242,	'Bridgette Hill',	1681,	NULL,	5.00,	'If you are looking for a teacher who will help you develop beautiful and easily understandable speech for Japanese speakers, I recommend turning to Filip as a professional and not wasting time on cheaper lessons.',	1,	'2024-07-30 21:48:40',	'2024-07-30 21:48:40'),
(243,	'Clara',	1681,	NULL,	5.00,	'Filip is a very good specialist. He seeks an approach to each problem and shows genuine interest in the student\'s further progress.',	1,	'2024-07-30 21:50:30',	'2024-07-30 21:50:30'),
(244,	'Edu Jean-Marie',	1681,	NULL,	4.50,	'Everything is great.',	1,	'2024-07-30 21:51:47',	'2024-07-30 21:51:47'),
(245,	'Rebecca',	1681,	NULL,	5.00,	'I was extremely satisfied with the lessons. I definitely recommend him if you are looking for a responsible and experienced teacher.',	1,	'2024-07-30 22:26:44',	'2024-07-30 22:26:44'),
(246,	'Yanko Kris',	1681,	NULL,	5.00,	'We started with learning the alphabets, with a new topic each time and homework assignments. I began from scratch, and now, after a year, I can speak and read!',	1,	'2024-07-30 22:28:20',	'2024-07-30 22:28:20'),
(247,	'Truth Martin',	1681,	NULL,	4.00,	'Everything was good, I liked everything.',	1,	'2024-07-30 22:48:11',	'2024-07-30 22:48:11'),
(248,	'Eyvindur Jarogniew',	1681,	NULL,	5.00,	'Pros: Responsible and friendly tutor who pays great attention to details. The lessons are very interesting, well-structured, and I noticed significant progress in the language almost immediately.\r\nDescription: I was looking for a tutor primarily to improve my conversational Japanese, and I am also interested in Japanese literature.',	1,	'2024-07-30 22:49:54',	'2024-07-30 22:49:54'),
(249,	'Prince',	1681,	NULL,	5.00,	'A very good teacher, we studied together for several months. Filip\'s enthusiasm and effort helped overcome the initial energy barrier in learning a language from a completely different culture.',	1,	'2024-07-31 01:56:28',	'2024-07-31 01:56:28'),
(250,	'Royce',	1699,	NULL,	5.00,	'The best teacher in the world! A teacher sent from above! In a short period of time, we achieved incredibly high results, exceeding all expectations. We are very fortunate to have found Noa Karhu!',	1,	'2024-08-13 13:04:15',	'2024-08-13 13:04:15'),
(251,	'Sophie',	1699,	NULL,	4.50,	'Thank you to the teacher! We\'ve been studying for 10 months and are planning to take the test soon.',	1,	'2024-08-13 16:17:12',	'2024-08-13 16:17:12'),
