(253,	'Paige',	1699,	NULL,	5.00,	'I am very glad that we chose Noa Karhu! His heartfelt approach and love for both the language and teaching are evident.\r\n\r\n- Thoughtful, precise, and up-to-date course.\r\n- Individual approach.\r\n- Focus on thoroughness.\r\n- Attention to detail.\r\n- ...all while being easy and pleasant to communicate with!',	1,	'2024-08-13 16:26:07',	'2024-08-13 16:26:07'),
(254,	'Violet',	1699,	NULL,	4.00,	'A teacher with their own program. We started learning from scratch. The student is engaged.',	1,	'2024-08-13 16:28:34',	'2024-08-13 16:28:34'),
(255,	'Willis',	1699,	NULL,	5.00,	'What I like about the lessons: the clearly developed AUTHOR\'S methodology, structured by lessons. Noa is demanding, but that\'s exactly the kind of teacher I was looking for. We\'ve made significant progress!',	1,	'2024-08-13 18:19:30',	'2024-08-13 18:19:30'),
(256,	'Audrey Hernandez',	1699,	NULL,	5.00,	'An excellent teacher! Everything is perfect.',	1,	'2024-08-13 18:22:17',	'2024-08-13 18:22:17'),
(257,	'Cheyenne',	1699,	NULL,	5.00,	'We\'ve been studying with Karhu for just over a year, during which time we prepared for and successfully passed HSK3. Before starting lessons with Karhu, I had already made three attempts to learn Chinese, all of which, unfortunately, were unsuccessful. From the very first lesson, I appreciated the systematic approach, with a structured lesson plan and plenty of materials. If problems or questions arose, Karhu would patiently explain everything as many times as needed.',	1,	'2024-08-13 18:30:15',	'2024-08-13 18:30:15'),
(258,	'Huub Bazza',	1699,	NULL,	2.00,	'Karhu is a poor specialist with an unclear teaching system.',	1,	'2024-08-13 18:36:42',	'2024-08-13 18:36:42'),
(259,	'Alexander',	1699,	NULL,	5.00,	'Pros:\r\n+ Will 100% find an approach that works for you\r\n+ Respectful attitude\r\n+ Very useful and effective methods\r\n+ I gained language skills and learned how to continue studying with other teachers or on my own\r\n+ Lessons are a lot of fun\r\n+ I\'ve been studying for almost a year, and I have exactly the results that were promised\r\n\r\nCons: None\r\n\r\nDescription: Highly recommend to everyone!',	1,	'2024-08-13 18:38:44',	'2024-08-13 18:38:44'),
(260,	'Calisto Kazuya',	1701,	NULL,	5.00,	'I started learning the language at a B2 level, as I needed it for work in a foreign company. The lessons are ongoing, and the results are very noticeable. As someone who began learning the language not from scratch, I can attest to the high professionalism of the teacher. Thank you 🙏🏻.',	1,	'2024-08-13 18:50:43',	'2024-08-13 18:50:43'),
(261,	'Jack',	1701,	NULL,	5.00,	'My daughter enjoys the lessons and has learned a lot in a short time. She is even trying to speak in Turkish. The teacher explains everything clearly, is very friendly and positive, yet also demanding. My daughter is thrilled with the teacher both as a person and as a specialist.',	1,	'2024-08-13 19:06:26',	'2024-08-13 19:06:26'),
(262,	'Trey Young',	1701,	NULL,	5.00,	'I was very fortunate to have found this teacher. Huseyin explains the material very clearly and simply, with nothing unnecessary. Additionally, he has his own teaching methodology with unique materials. The atmosphere is very friendly. Overall, I\'m very happy with this discovery. I definitely recommend him! The best.',	1,	'2024-08-13 19:08:56',	'2024-08-13 19:08:56'),
