(265,	'Monica Perez',	1683,	NULL,	2.00,	'There was little practice, which is a downside, and few new words. I\'m not satisfied with the choice of tutor.',	1,	'2024-08-13 19:43:16',	'2024-08-13 19:43:16'),
(266,	'Arlie Triantafyllos',	1683,	NULL,	5.00,	'I decided to learn Turkish, and my knowledge level was zero. I found Joan on the website, and I made the right choice! I really like my teacher, Joan. He explains everything very patiently and clearly.',	1,	'2024-08-13 19:47:33',	'2024-08-13 19:47:33'),
(267,	'Molly',	1683,	NULL,	5.00,	'I\'ve been studying Turkish for 2 months, and I\'ve significantly improved my speaking skills. I like everything about it; my teacher is wonderful—patient and even laughs at my jokes. Tomorrow I\'m flying to Turkey, where I\'ll practice what I\'ve learned. Thank you for your work 🫶🏽.',	1,	'2024-08-13 19:50:29',	'2024-08-13 19:50:29'),
(268,	'Jaiden',	1683,	NULL,	4.00,	'I only completed one trial lesson. There was a bit of misunderstanding on my part regarding the cost of the lessons.',	1,	'2024-08-13 19:54:45',	'2024-08-13 19:54:45'),
(269,	'Riny Munroe',	1683,	NULL,	5.00,	'A wonderful teacher, the lessons are quick and fun. Even if you\'re too lazy to do your homework, Turkish still somehow sinks in! There are many interactive tasks and a non-boring approach. There\'s a wide variety of learning materials. I highly recommend this teacher for both children and adults.',	1,	'2024-08-13 20:00:30',	'2024-08-13 20:00:30'),
