(325,	'Madison',	1966,	NULL,	5.00,	'I was looking for a teacher who could, first, teach the language at a deep, university-level, second, compare it with other European languages (in our case, French), and third, make the lessons engaging by including not only the language but also its history and culture. I must also highlight the teacher’s punctuality and responsibility. We are very satisfied and will continue with the lessons.',	1,	'2024-11-07 00:26:24',	'2024-11-07 00:51:57'),
(326,	'Harriet Lane',	1966,	NULL,	4.00,	'Managed to pass the exam with a decent grade and improve my knowledge somewhat.',	1,	'2024-11-07 00:29:08',	'2024-11-07 00:51:59'),
(327,	'Michaela',	1966,	NULL,	5.00,	'This is our first experience with lessons in this format, and it’s very pleasing that everything happens quickly, dynamically, and on time. It’s too early to speak about the results, but the fact that the process is active is encouraging.',	1,	'2024-11-07 00:30:39',	'2024-11-07 00:52:01'),
(328,	'Lynnette',	1966,	NULL,	5.00,	'I enjoyed studying with her; it was interesting. I think I’ll continue working with her next school year. We selected suitable exercises, started speaking, completed assignments, and I even started a notebook for special vocabulary. She’s friendly and always found topics for conversation when we needed a short break. My studies have improved.',	1,	'2024-11-07 00:33:18',	'2024-11-07 00:52:02'),
(329,	'Herb Hampton',	1966,	NULL,	4.00,	'A decent, knowledgeable teacher, responsible and with an individual approach to the student. We’ve temporarily paused the lessons, but they were fairly effective. The teacher helped me develop some interest and motivation to study the language.',	1,	'2024-11-07 00:35:43',	'2024-11-07 00:52:03'),
