(335,	'Daisy',	1966,	NULL,	5.00,	'Vera is a very wise teacher with extensive experience and an individual approach. Only the highest recommendations.',	1,	'2024-11-07 00:55:18',	'2024-11-07 01:02:48'),
(336,	'Mary',	1966,	NULL,	5.00,	'I reached out to Vera to get closely acquainted with the Czech language. The results exceeded all possible expectations. The teacher not only \'immersed\' me in the language but also shared insights about the daily life and culture of the country, which has definitely boosted my interest in learning. Vera is very attentive, tailors her approach based on the student\'s individual characteristics, organizes information systematically, and creates models to facilitate learning. The lessons feel natural, and language acquisition happens quickly, easily, and effectively. I would recommend her to anyone who wants to learn Czech quickly and with enjoyment. Many thanks to Vera for her engaging teaching approach and her dedication to her work.',	1,	'2024-11-07 00:57:41',	'2024-11-07 01:02:51'),
(337,	'Irma Mclaughlin',	1966,	NULL,	5.00,	'After each lesson, my mind feels energized, like after an intense intellectual workout. For future students, I recommend setting a clear goal for studying the language, considering your contexts of use, and not being afraid to ask questions.',	1,	'2024-11-07 00:59:08',	'2024-11-07 01:02:53'),
(338,	'fufu@mail.com',	1966,	NULL,	4.00,	'She provides a fair amount of knowledge and shares some information about history and culture, though not as in-depth as expected.',	1,	'2024-11-07 01:00:44',	'2024-11-07 01:02:53'),
(339,	'Lorainne',	1966,	NULL,	2.00,	'Unfortunately, my lessons with Vera didn’t meet my expectations. While the atmosphere was relaxed, I felt it didn’t contribute much to effective language learning.',	1,	'2024-11-07 01:02:30',	'2024-11-07 01:02:55'),
(340,	'Psyche Saffman',	1965,	NULL,	5.00,	'Explains everything very clearly, and the variety of exercises makes the learning process engaging. Has a unique teaching method that immediately grabs your attention and interest. In a short time, I can already hold simple conversations and understand much of what I hear. Huge thanks!',	1,	'2024-11-07 01:05:51',	'2024-11-07 02:03:07'),
(341,	'Faidon',	1965,	NULL,	5.00,	'Everything is excellent.',	1,	'2024-11-07 01:11:43',	'2024-11-07 02:03:06'),
