(343,	'Felix',	1965,	NULL,	5.00,	'Sam was my tutor for a year and a half. We had both in-person and online lessons, and I was completely satisfied with both options. The atmosphere during lessons was friendly, with a clear individual approach. Initially, we prepared for IELTS; Sam was very knowledgeable, fully understood the exam structure, helped me with all the nuances, and created word lists for specific topics, which was incredibly convenient. The conversation lessons were also excellent; Sam selected interesting discussion topics and created special games.\n\nI sincerely thank Sam for the work we did together and highly recommend lessons with him to everyone.',	1,	'2024-11-07 01:18:49',	'2024-11-07 02:03:03'),
(344,	'Taylor',	1965,	NULL,	4.00,	'We started lessons in September to prepare for the IELTS exam.',	1,	'2024-11-07 01:22:04',	'2024-11-07 02:03:02'),
(345,	'Dana',	1965,	NULL,	5.00,	'Very satisfied with the tutor. Sam found the right approach from the first lesson, identified gaps in my knowledge, and is gradually helping me address them. He explains material in a very simple and accessible way. I feel more confident in many areas that previously caused doubt. I would like to highlight her punctuality and reliability. Thank you for your help! We look forward to continued collaboration and a successful IELTS result.',	1,	'2024-11-07 01:27:23',	'2024-11-07 02:03:01'),
