(347,	'Jed',	1965,	NULL,	2.00,	'The way information is presented is fine, pretty standard and straightforward. The tutor has a personal method, but it didn’t work well for me.',	1,	'2024-11-07 01:41:19',	'2024-11-07 02:02:57'),
(348,	'Bennett',	1965,	NULL,	3.00,	'My grades did improve, I won’t deny that, but I hired a tutor specifically to prepare for an essay, and while I did write it, I didn’t feel the preparation was as effective as I’d hoped.',	1,	'2024-11-07 01:43:37',	'2024-11-07 02:02:56'),
