(356,	'Keith',	1963,	NULL,	5.00,	'Lessons with Daniela are filled not only with practical exercises but also focus on real-life situations. In class, we go over phrases and dialogues that I encounter daily. Thanks to these lessons, I’ve become more confident in using Spanish.',	1,	'2024-11-07 02:24:53',	'2024-11-07 03:53:52'),
(357,	'Megara Bridgman',	1963,	NULL,	5.00,	'Daniela left me with only the most positive impressions. Her professionalism and warmth created a comfortable atmosphere in the learning process. She was always ready to help and explain any difficulties, making the language-learning experience enjoyable and productive. I am sincerely grateful for her valuable contribution to my Spanish language studies.',	1,	'2024-11-07 02:28:18',	'2024-11-07 03:53:53'),
