(365,	'Ashley',	1963,	NULL,	5.00,	'An excellent teacher with a lot of experience! Daniela explains all topics very clearly and thoroughly. I especially want to highlight her focus on grammar, as it is essential for speech accuracy and proper sentence structure. She has a genuine desire to teach the language, which is rare these days! I am satisfied and recommend her to everyone!',	1,	'2024-11-07 03:07:57',	'2024-11-07 03:54:11'),
