(379,	'Eric',	1962,	NULL,	5.00,	'My deepest gratitude to Alina for her professional approach and flexibility. She explains everything in an incredibly interesting and clear way, taking all my preferences into account 🙏🏽 I’m continuing with the lessons 🙏🏽 I thought learning Turkish at 35 would be extremely difficult, but thanks to Alina, I’ve gained confidence that I can succeed, and I’ve fallen even more in love with Turkish!',	1,	'2024-11-07 04:26:34',	'2024-11-07 04:57:58'),
