(381,	'Yianna',	1962,	NULL,	5.00,	'I want to express my immense gratitude to Alina for her responsible approach to teaching! We\'ve been studying together for 7 months. My goal is fluent communication, and every time, Alina finds interesting topics for conversation and practice, listens to my needs, and creates material that is both essential and fully engaging 😉 Recently, I was in Istanbul, practicing all that we had studied before. I didn’t expect to feel so comfortable and confident, communicating freely... From the very first moment, I spoke Turkish with confidence, understanding absolutely everything and everyone! And most importantly—I fell even more in love with Turkish 🥰 To me, this is the highest indicator of teaching quality and the teacher’s expertise! Thank you so much, Alina! MY RECOMMENDATION to everyone wanting to learn Turkish!',	1,	'2024-11-07 04:34:58',	'2024-11-07 04:57:56'),
