(384,	'Addison',	1962,	NULL,	5.00,	'I chose Aline based on reviews, and I wasn\'t disappointed 👍',	1,	'2024-11-07 04:40:34',	'2024-11-07 04:57:51'),
(385,	'Dora',	1962,	NULL,	5.00,	'I\'m glad to be studying Turkish with Alina. In my opinion, the learning program is very well structured, the explanations are clear, and it\'s evident that the teacher is invested in the results.',	1,	'2024-11-07 04:42:02',	'2024-11-07 04:57:50'),
