(389,	'Danika',	1962,	NULL,	5.00,	'Learning has been very easy! Time flies by unnoticed. I started learning Turkish from level 0 and began reading after the second lesson. The material is absorbed quickly and easily. An amazing teacher! I eagerly look forward to each new lesson.',	1,	'2024-11-07 04:51:06',	'2024-11-07 04:57:43'),
