(394,	'Samantha',	1960,	NULL,	5.00,	'The best French teacher, and I have others to compare with! Very knowledgeable, teaches well and interestingly, doesn’t waste time, and provides a lot of useful material. Highly recommend!',	1,	'2024-11-07 05:04:43',	'2024-11-07 05:11:25'),
