(407,	'Bonita',	1706,	NULL,	5.00,	'I passed the IELTS with a score of 7.0, so now I can try applying to a university in the UK, just as I wanted. Clarissa helped me by tailoring an individual approach, explaining all the tasks in the tests, and pointing out potential pitfalls. We went through many practice options. I’ll definitely recommend her to friends!',	1,	'2024-11-07 06:00:01',	'2024-11-07 06:30:22'),
