(416,	'Thor',	1706,	NULL,	5.00,	'An excellent teacher. We will happily continue the lessons. I recommend Clarissa as a true professional in her field.',	1,	'2024-11-07 06:23:49',	'2024-11-07 06:30:10'),
(417,	'Mabon',	1706,	NULL,	4.00,	'The lessons are interesting, productive, and versatile.',	1,	'2024-11-07 06:25:24',	'2024-11-07 06:30:09'),
(418,	'Camillus Ricci',	1706,	NULL,	5.00,	'Clarissa is an excellent teacher. Thank you for the lessons! Everything is interesting and professional!',	1,	'2024-11-07 06:29:32',	'2024-11-07 06:30:08'),
(419,	'Aron',	1706,	NULL,	5.00,	'I can already see the results of our lessons 👍',	1,	'2024-11-07 06:32:46',	'2024-11-07 07:02:16'),
(420,	'Aubrey',	1706,	NULL,	4.00,	'Currently preparing for the IELTS international exam; I\'ll leave another review afterward.',	1,	'2024-11-07 06:34:57',	'2024-11-07 07:02:15'),
(421,	'Iefan',	1706,	NULL,	5.00,	'We are completely satisfied; the teacher is open to communication and can discuss topics beyond just English. Everything is punctual, and there have been no disruptions.',	1,	'2024-11-07 06:37:15',	'2024-11-07 07:02:13'),
(422,	'Julius',	1706,	NULL,	5.00,	'Super! The teacher is truly amazing.',	1,	'2024-11-07 06:38:56',	'2024-11-07 07:02:12'),
(423,	'Pietro',	1706,	NULL,	5.00,	'Wonderful teacher with a creative approach to lessons.',	1,	'2024-11-07 06:41:18',	'2024-11-07 07:02:10'),
(424,	'Atheas',	1706,	NULL,	3.00,	'The teacher\'s work didn’t meet our expectations, and we weren’t fully satisfied.',	1,	'2024-11-07 06:43:03',	'2024-11-07 07:02:10'),
(425,	'Placus Koenig',	1706,	NULL,	5.00,	'Preparation for the international IELTS exam in English. Many thanks to Clarissa. Thanks to this talented teacher, I was able to prepare for the international exams.',	1,	'2024-11-07 06:48:02',	'2024-11-07 07:02:07'),
(426,	'Rosetta Greer',	1706,	NULL,	5.00,	'Clarissa does an excellent job with the task at hand. Huge thanks to her for the help with my learning.',	1,	'2024-11-07 06:50:31',	'2024-11-07 07:02:07'),
(427,	'Pasiphae',	1706,	NULL,	2.00,	'I’m not fully satisfied with the learning experience. I didn’t feel as much benefit from the lessons as I’d hoped, especially regarding the university program—there are still gaps in my knowledge. My understanding hasn’t improved as much as expected.',	1,	'2024-11-07 06:55:43',	'2024-11-07 07:02:05'),
(428,	'Ada',	1706,	NULL,	5.00,	'The foundation of my English studies was laid by Clarissa—a wonderful specialist in her field, and I’m very grateful to her! That’s why it’s easy for me to continue progressing and improving.',	1,	'2024-11-07 06:59:06',	'2024-11-07 07:02:04'),
(429,	'Traci',	1704,	NULL,	4.00,	'Everything is good.',	1,	'2024-11-07 07:09:54',	'2024-11-07 07:29:05'),
(430,	'Bobby',	1704,	NULL,	3.00,	'The specialist wasn’t quite the right fit. Overall, no major complaints, but they didn’t manage to instill confidence in me. I still feel uncertain.',	1,	'2024-11-07 07:14:42',	'2024-11-07 07:29:06'),
(432,	'Linda',	1704,	NULL,	5.00,	'David was my first Spanish teacher, and it was great because his energy set the right tone for my entire language-learning journey. Lessons with David were varied, engaging, and dynamic. We practiced grammar rules in a way that made them stick in my memory. Many thanks to David for his professional approach.',	1,	'2024-11-07 07:24:10',	'2024-11-07 07:29:15'),
(433,	'Natalie',	1704,	NULL,	5.00,	'I really enjoy studying with David. In just 1.5 months, he has explained almost all of Spanish grammar to me, and we are preparing for an exam. I am very grateful for his hard work and patience 😁',	1,	'2024-11-07 07:26:25',	'2024-11-07 07:29:16'),
(434,	'Makenzie',	1704,	NULL,	5.00,	'An excellent specialist! The lessons are very engaging, and the results don’t take long to show. I highly recommend this specialist. Thank you!',	1,	'2024-11-07 07:28:18',	'2024-11-07 07:29:16'),
