(580,	'Tajana',	1682,	NULL,	4.00,	'Richard has his own teaching method and demonstrates understanding toward his students.',	1,	'2024-11-12 01:06:44',	'2024-11-12 02:18:59'),
(581,	'Cooper',	1682,	NULL,	5.00,	'I\'ve been studying Korean with the teacher for three months. The teacher explains everything clearly and accessibly, going over the material in detail. He is very easy to talk to, and the lessons are conducted in a way that’s interesting to me, where I can ask any question related to both the language and Korea. This makes learning and understanding the material fast and informative.',	1,	'2024-11-12 01:12:02',	'2024-11-12 02:18:56'),
(582,	'Zuzanka',	1682,	NULL,	5.00,	'I really enjoy the lessons, everything is explained in detail and clearly. At the end of each lesson, he assigns homework. It\'s a pleasure to communicate with Richard. We are very satisfied with the lessons! Highly recommend Richard as a Korean language teacher!',	1,	'2024-11-12 01:16:47',	'2024-11-12 02:18:55'),
(583,	'Alex',	1682,	NULL,	5.00,	'I really enjoyed it; we studied together for six months, and it was very beneficial. There were noticeable results—after the lessons, I went to Korea and was able to hold conversations, navigate the city, and say everything essential. We covered everything: speaking, writing, a university-level curriculum, reading texts, building vocabulary, and a lot of grammar, in a student-oriented way. I think Richard explains very well, and I was never bored. It\'s comfortable to work with him, and there was always something to chat about in both Korean and Russian. He\'s a pleasant person, genuinely dedicated to his work, clearly passionate about Korean, and it\'s always a pleasure to study with him.',	1,	'2024-11-12 01:20:22',	'2024-11-12 02:18:53'),
(584,	'Miko',	1682,	NULL,	2.00,	'Unfortunately, my experience with Richard didn’t meet my expectations. Although he was punctual and friendly, the lessons felt unstructured, and I didn’t see the progress I was hoping for. He assigned tasks but didn’t provide thorough feedback, and the scheduling was sometimes inconvenient. Overall, I’m disappointed and won’t be continuing.',	1,	'2024-11-12 01:23:18',	'2024-11-12 02:18:52'),
(585,	'Calogero',	1682,	NULL,	4.00,	'We studied for only a short time—about two months. Everything was fine.',	1,	'2024-11-12 01:25:18',	'2024-11-12 02:18:49'),
(586,	'Karl',	1682,	NULL,	5.00,	'I want to say a huge thank you! Richard is not just a \'tutor\'; he\'s a wonderful, talented, and ambitious teacher who can connect with both adults and children! As a teacher myself, it was important for me to find someone who resonates with me, and Richard does just that—not just a great fit, but truly touching the heart!',	1,	'2024-11-12 01:30:05',	'2024-11-12 02:18:48'),
(587,	'Jerry',	1682,	NULL,	4.00,	'Richard  is an awesome teacher! In his lessons, you’ll find carefully crafted materials, quizzes, leaderboards, memes, discussions, and so much more :) My learning has progressed by leaps and bounds, although there is a lot of homework.',	1,	'2024-11-12 01:33:09',	'2024-11-12 02:18:46'),
(588,	'Ivan',	1682,	NULL,	5.00,	'The lessons have a great vibe, no discomfort at all, and I look forward to each one with excitement ✨',	1,	'2024-11-12 01:46:00',	'2024-11-12 02:18:45'),
(589,	'Alicia Hubert',	1682,	NULL,	5.00,	'I\'m so glad I started learning Korean with you!!',	1,	'2024-11-12 02:05:26',	'2024-11-12 02:18:44'),
(590,	'Rosa',	1682,	NULL,	5.00,	'I absolutely enjoy studying with this teacher! I previously had experience with another Korean teacher, where I often felt like I was ready to fall asleep in class, constantly frustrated at not understanding something. We were always rushing, even though I’m learning languages just for myself, so there was no need to hurry 😅\n\nNow, with Richard, I feel completely comfortable. I never feel irritated or frustrated, even for a second. He explains everything clearly and accessibly, and he always tries to make the lessons diverse, which makes them even more interesting. I look forward to each lesson every week. Thank you so much 🩷 I hope to soon speak as well as a native speaker 😆, and I’m confident that with these lessons and my motivation, I’ll get there ❤️',	1,	'2024-11-12 02:09:12',	'2024-11-12 02:18:42'),
(591,	'Jan Prissy',	1682,	NULL,	2.00,	'Unfortunately, Richard didn’t provide the level of attentiveness I was hoping for and rarely gave feedback after the lessons.',	1,	'2024-11-12 02:11:04',	'2024-11-12 02:18:41'),
(592,	'Blake',	1682,	NULL,	5.00,	'One of the best teachers I’ve ever had! He\'s very pleasant and understanding. Explains everything well, and I pick up the material very quickly. The atmosphere in the lessons is nice and comfortable. We will continue with the lessons!',	1,	'2024-11-12 02:13:10',	'2024-11-12 02:18:39'),
(593,	'Pamela',	1682,	NULL,	5.00,	'A convenient system in terms of both scheduling and the learning process. Comfortable lessons, kindness, and responsiveness. After each lesson, I see progress and feel motivated to keep going.',	1,	'2024-11-12 02:15:12',	'2024-11-12 02:18:37'),
(594,	'Carl',	1682,	NULL,	2.00,	'Unfortunately, I haven’t felt the connection I was hoping for during our lessons. The atmosphere wasn’t as comfortable as I expected, and my motivation to study Korean hasn’t really increased. Explanations weren’t as clear or accessible as I would have liked.',	1,	'2024-11-12 02:18:15',	'2024-11-12 02:18:36'),
(595,	'Martin',	1679,	NULL,	5.00,	'Esser is a wonderful teacher! The lessons are interesting, informative, and take place in a comfortable setting. I\'m so glad I found the best teacher ❤️',	1,	'2024-11-12 02:22:27',	'2024-11-12 02:45:40'),
(596,	'Aaron',	1679,	NULL,	5.00,	'The teacher is simply amazing! The lessons are interesting and interactive. The material is presented and explained wonderfully. The teacher is cheerful, kind, and knows how to connect with students. Everything is just perfect!!',	1,	'2024-11-12 02:26:19',	'2024-11-12 02:45:39'),
(597,	'Gil Smith',	1679,	NULL,	5.00,	'In just a month, I learned to read and form simple sentences. Esser explains the material very clearly, and the lessons take place in a relaxed, friendly atmosphere. He’s always ready to answer any questions. It’s a pleasure working with you; thank you so much!',	1,	'2024-11-12 02:28:49',	'2024-11-12 02:45:37'),
(598,	'Katy',	1679,	NULL,	5.00,	'The lessons take place in a quite comfortable setting, and the ability to convey information is simply top-notch.',	1,	'2024-11-12 02:31:14',	'2024-11-12 02:45:36'),
(599,	'Serena',	1679,	NULL,	5.00,	'The best teacher ever!! I’m so lucky to have found someone like him^^ The lessons are very comfortable, with no rush, and there\'s an individual approach for each student ♡',	1,	'2024-11-12 02:33:24',	'2024-11-12 02:45:34'),
(600,	'Elba',	1679,	NULL,	2.00,	'Unfortunately, I didn’t find his explanations as clear as I’d hoped, especially with more complex topics.',	1,	'2024-11-12 02:35:31',	'2024-11-12 02:45:33'),
(601,	'John',	1679,	NULL,	4.00,	'THX',	1,	'2024-11-12 02:36:40',	'2024-11-12 02:45:31'),
(602,	'Tamika',	1679,	NULL,	5.00,	'Everything is good. I really liked it. He\'s easy to work with, approachable, and sociable.',	1,	'2024-11-12 02:39:39',	'2024-11-12 02:45:29'),
(603,	'Lars Urh',	1679,	NULL,	5.00,	'Explains things simply and clearly. The information is presented with humor and in an easygoing manner.',	1,	'2024-11-12 02:41:28',	'2024-11-12 02:45:28'),
(604,	'Chad',	1679,	NULL,	5.00,	'Comfortable, individualized approach. Esser is genuinely invested in teaching you the language. There’s no sense of \'rushing\' when explaining material, and the way information is presented is engaging.',	1,	'2024-11-12 02:45:07',	'2024-11-12 02:45:26'),
(605,	'Dixie Brown',	1702,	NULL,	5.00,	'A very positive, kind, and approachable tutor who presents information in a very accessible way.',	1,	'2024-11-12 02:50:26',	'2024-11-12 02:59:45'),
(606,	'Callie',	1702,	NULL,	5.00,	'I like the teacher’s sociable nature. Explains things in an interesting way using simple language, without scientific terms, making everything easy to understand. We quickly found common ground, and there are results.',	1,	'2024-11-12 02:53:12',	'2024-11-12 02:59:43'),
(607,	'Laco',	1702,	NULL,	4.00,	'We are continuing lessons with the tutor; everything is going well.',	1,	'2024-11-12 02:54:53',	'2024-11-12 02:59:42'),
(608,	'Vladislav',	1702,	NULL,	5.00,	'I recommend the teacher!',	1,	'2024-11-12 02:56:21',	'2024-11-12 02:59:41'),
