(610,	'Oakman',	1699,	NULL,	5.00,	'Explains the material in a very clear and interesting way, always with a positive attitude.',	1,	'2024-11-12 03:04:24',	'2024-11-12 11:02:26'),
(611,	'Rox',	1699,	NULL,	4.00,	'We are still on the path to results. The price matches the quality.',	1,	'2024-11-12 03:07:00',	'2024-11-12 11:02:28'),
(612,	'bcfcyy@mail.com',	1699,	NULL,	5.00,	'I work twice a week, and I am very satisfied. It\'s worth noting that this is my third tutor, but I’m absolutely thrilled with Noa Karhu and look forward to each session.',	1,	'2024-11-12 03:28:43',	'2024-11-12 11:02:28'),
(613,	'Adam',	1699,	NULL,	5.00,	'An individualized learning plan that suits me perfectly, very flexible, always accommodating my schedule, and even ordered literature from China for me. Huge Thanks👍👍👍👍👍👍👍👍👍👍👍👍',	1,	'2024-11-12 03:37:13',	'2024-11-12 11:02:29'),
(614,	'Carter',	1699,	NULL,	5.00,	'We really like Noa. He is a knowledgeable specialist who applies no pressure, knows how to explain material in an interesting and clear way, and engages the student effectively.',	1,	'2024-11-12 03:44:20',	'2024-11-12 11:02:29'),
(615,	'Jean-Charles',	1699,	NULL,	5.00,	'We chose Noa after reading the reviews, and we weren’t disappointed. The lessons are very engaging, making it feel like Chinese isn’t even that difficult. Everything is clear and easy. It’s evident that Noa is a master of her craft. HIGHLY RECOMMEND.',	1,	'2024-11-12 11:05:59',	'2024-11-12 11:17:39'),
(616,	'Phil',	1699,	NULL,	2.00,	'We were not satisfied with the quality of the lessons.',	1,	'2024-11-12 11:07:20',	'2024-11-12 11:17:37'),
(617,	'Assandros',	1699,	NULL,	2.00,	'Noa\'s explanations of the material weren\'t as clear as I had hoped, especially considering how challenging the language is.',	1,	'2024-11-12 11:11:19',	'2024-11-12 11:17:37'),
(618,	'Nikola',	1699,	NULL,	5.00,	'Very satisfied. The specialist is excellent!',	1,	'2024-11-12 11:14:03',	'2024-11-12 11:17:35'),
(619,	'Rita',	1699,	NULL,	5.00,	'We are absolutely thrilled with the lessons with Noa! There is a huge difference compared to previous tutors. I enjoy the lessons; the material is presented in an engaging way, and I remember a lot from the lesson, so there\'s almost no need for additional studying.',	1,	'2024-11-12 11:17:10',	'2024-11-12 11:17:34'),
(620,	'Olga',	1687,	NULL,	5.00,	'I really like Murat\'s teaching method.',	1,	'2024-11-12 11:20:35',	'2024-11-12 11:42:03'),
(621,	'Henry',	1687,	NULL,	5.00,	'The material is covered very thoroughly and in depth. Grammar and dialogues are practiced effectively, and the language is presented in an engaging way.',	1,	'2024-11-12 11:24:59',	'2024-11-12 11:42:02'),
(622,	'Bobby',	1687,	NULL,	5.00,	'Good day!! Murat is a professional, competent, and excellent Arabic language teacher.',	1,	'2024-11-12 11:27:18',	'2024-11-12 11:42:01'),
(623,	'Kimberly',	1687,	NULL,	4.00,	'The tutor is good.',	1,	'2024-11-12 11:28:47',	'2024-11-12 11:42:00'),
