                                                                                                                                                                                                                                                                                                                                                                                                                              (156,	22,	'Clayton James William',	'',	1,	'wclaytonjames@gmail.com',	'I m Steve, a skilled UX designer specializing in creating exceptional user experiences that bridge the gap between functionality and aesthetics. \r\n\r\nI will provide you with the following services: \r\n\r\nUser Research and Analysis: conducting thorough user research, employing techniques such as user interviews, surveys, and usability testing to gain valuable insights.\r\n\r\nInformation Architecture: creating logical hierarchies and user-friendly interactions.\r\n\r\nUser Interface (UI) Design: crafting visually appealing and intuitive user interfaces, employing principles of visual hierarchy, typography, color theory, and brand consistency to create engaging digital experiences.\r\n\r\nInteraction Design: focusing on designing meaningful interactions between users and digital interfaces.\r\n\r\nUsability Testing and Iteration: conducting usability testing sessions, collecting feedback, and improving the user experience based on real user insights.\r\n\r\nContact me today to discuss your UX design needs and create intuitive and impactful designs that captivate your users.',	0.00,	'',	NULL,	NULL,	'$2y$10$HPdMNLhVYEIHtB4JF0u.MOHXvjqHQvJIir2dbxoSox/KYIu.40J3u',	'',	NULL,	0.0000000,	0.0000000,	0,	'',	'',	'',	0.00,	'',	NULL,	NULL,	NULL,	0,	1,	NULL,	NULL,	'2023-07-12 14:18:17',	'2023-11-06 15:07:26'),
