                                                                                                                                                                                                                                                                                                                                                                                                                              (1686,	29,	'Andrew Percy Kyle',	'',	1,	'andrew.p@gmail.com',	'Hello! I am Andrew, and for over 10 years, I have dedicated my career to teaching English online, sharing the joy of language learning with students from more than 20 countries. \r\n\r\nMy Teaching Philosophy:\r\n\r\nI use a blend of techniques including the Communicative Language Teaching (CLT) method, ensuring that you will learn English in a way that is both natural and relevant to real-life situations.\r\n\r\nMy Experience and Expertise:\r\n\r\n- With a Master degree in Applied Linguistics and TEFL certification, my expertise covers a wide spectrum of linguistic skills. \r\n- Over the past decade, I have successfully conducted over 3,000 online sessions, catering to students ranging from beginners (A1) to advanced learners (C2). \r\n\r\nMy specialties include:\r\n\r\n- Conversational fluency and accent reduction\r\n- Academic writing and examination preparation (IELTS, TOEFL with over 200 students achieving scores above 7.5 and 100+ respectively)\r\n- Business English for professional communication (helped over 150 professionals enhance their career opportunities)\r\n\r\nMy Experience and Expertise:\r\n- 10+ years teaching English online.\r\n- TESOL certified, with a Masters degree in Linguistics.\r\n- Over 500 students from more than 40 countries.\r\n- Conversational English, Business English, Exam Preparation (IELTS, TOEFL), and English for Specific Purposes (ESP).\r\n\r\nMy services are:\r\n\r\n- Customized Online English Lessons\r\n- IELTS/TOEFL Exam Preparation\r\n- Business English Courses\r\n- Cultural Competence Coaching\r\n- Conversational English Practice\r\n- Writing Workshops\r\n- Support for English Language Learners\r\n\r\nContact me to discover how we can achieve your English language goals together, and take the first step towards unlocking your full potential.',	0.00,	'',	NULL,	NULL,	'$2y$10$.wrhWJO0HCvOp0.ZiOEBPODjDtWwmFUmnLlKyVFHjbk/pVhjRUKEu',	'1-IIjIghA534gwPYKRjY29.jpg',	NULL,	0.0000000,	0.0000000,	77,	'',	'',	'',	20.90,	'',	NULL,	NULL,	NULL,	1,	1,	NULL,	NULL,	'2024-03-05 09:44:43',	'2024-03-13 11:45:45'),
                                                                                                                                                                                                                                                                                                                                                                                                                              (1687,	41,	'Murat Ergun',	'',	1,	'murat_ergun@gmail.com',	'I am Murat Ergun, a fervent educator in the Arabic language, dedicated to unraveling the beauty and complexity of Arabic to learners worldwide. With my extensive background, including a Master’s degree in Arabic Linguistics and 15 years of teaching experience, I have crafted a unique approach that simplifies the Arabic learning process for over 1,000 students from 60+ countries.\r\n\r\nWhy Learn Arabic with Me?\r\n\r\nArabic, a language of rich history, profound literature, and diverse cultures, offers learners a gateway to a myriad of opportunities:\r\n\r\n- Cultural Immersion: Experience the depth of Arab culture through 400+ cultural exploration activities, including virtual museum tours, literature workshops, and traditional music sessions.\r\n\r\n- Career Enhancement: Elevate your professional prospects, as 90% of my students have successfully used their Arabic skills in fields such as international relations, journalism, and commerce.\r\n\r\n- Language Proficiency: Benefit from 1,200+ hours of immersive instruction, designed to master reading, writing, speaking, and comprehension, making Arabic accessible to all learners.\r\n\r\nMy Teaching Methodology: A Blend of Tradition and Innovation\r\n\r\n- Interactive Techniques\r\n- Comprehensive Language Skills Development\r\n- Cultural Competency\r\n\r\nSkills and Qualifications:\r\n\r\n- Linguistic Mastery: Deep understanding of Modern Standard Arabic and various dialects, from Levantine to Egyptian Arabic.\r\n\r\n- Pedagogical Expertise: Expert in applying pedagogical theories to language teaching, ensuring high engagement and effective learning outcomes.\r\n\r\n- Innovative Educator: Continuously incorporating the latest in language learning technology and methodology to keep lessons fresh, exciting, and impactful.\r\n\r\nHere are my services:  \r\n\r\n- Arabic Calligraphy Courses\r\n- Personalized Online Arabic Lessons\r\n- Modern Standard Arabic (MSA) and Dialectical Variations\r\n- Conversational Arabic Practice\r\n- Arabic for Business Professionals\r\n- Preparation for Arabic Proficiency Tests (e.g., ALPT)\r\n- Arabic Grammar and Vocabulary Workshops\r\n- Arabic Literature and Quranic Arabic\r\n\r\nStart Your Arabic Adventure Today',	0.00,	'',	NULL,	NULL,	'$2y$10$cseWvMuhCEJzVN3S9nrbVOzJAQbJ2Qj3YATDwb3H9CZdKW5P8uci.',	'1-Pm14v7IcXZLHTdOFjTKy.jpg',	NULL,	0.0000000,	0.0000000,	225,	'',	'',	'',	25.45,	'',	NULL,	NULL,	NULL,	1,	1,	NULL,	NULL,	'2024-03-05 10:39:12',	'2024-04-03 15:10:55'),
