                                                                                                                                                                                                                                                                                                                                                                                                                              (1959,	29,	'Robert Cornea',	NULL,	1,	'robert@gmail.com',	'Hello! My name is Robert Cornea, and I’m here to make learning English accessible, engaging, and effective. With over 10 years of experience helping students from all backgrounds, I bring expertise and dedication to every lesson.\r\nQualifications:\r\nBachelor’s Degree in English Language and Literature\r\nTEFL Certification (Teaching English as a Foreign Language)\r\nWhy Choose Me?\r\nProven Success: Over 600 students from more than 35 countries have reached their language goals with my guidance.\r\nTailored Approach: I design unique lesson plans for each learner—1,000+ customized lessons developed.\r\nHigh Achievement Rate: 95% of my students achieve their English proficiency targets.\r\nPortfolio Highlights:\r\nBlended traditional teaching with digital resources, using interactive apps and 250+ educational materials\r\nGuided 85% of my students to achieve their desired IELTS and TOEFL scores\r\nCreated a resource library with 400+ exercises, video lessons, and practice quizzes for all skill levels\r\nWhat I Offer:\r\nCustom English Language Lessons\r\nInteractive Speaking and Listening Sessions\r\nGrammar and Vocabulary Building\r\nBusiness English and Corporate Communication\r\nExam Prep (IELTS, TOEFL)\r\nPronunciation Practice and Accent Reduction\r\nIf you’re ready to gain confidence and fluency in English, I’m here to guide you every step of the way. Start your journey to mastering English with me today!',	0.00,	'',	NULL,	NULL,	'$2y$10$zx/EQWj5w5D.3N9m72vdDOg3c1miP0JCs619Rahxb6bLq65pstUsi',	'1-lu