                                                                                                                                                                                                                                                                                                                                                                                                                              (1960,	33,	'Ramona Rus',	NULL,	2,	'ramona1@gmail.com',	'Bonjour! I’m Ramona Rus, a passionate French teacher with over 8 years of experience in helping learners speak and enjoy French with confidence. Let’s explore this beautiful language together!\r\nQualifications:\r\nMaster’s Degree in French Studies\r\nCertified Instructor in French as a Second Language\r\nWhy Learn with Me?\r\nGlobal Reach: Taught French to over 400 students from 30+ countries\r\nPersonalized Plans: Created over 600 tailor-made lessons to meet diverse student needs\r\nSuccess Rate: 88% of my students reach their French language goals\r\nPortfolio Highlights:\r\nUsed a blend of traditional and digital methods with 150+ multimedia resources\r\nHelped 75% of my students achieve high scores on DELF/DALF exams\r\nBuilt a content library with 200+ videos, quizzes, and exercises for beginner to advanced levels\r\nMy Services:\r\nPersonalized French Lessons for All Levels\r\nConversational French for Real-Life Situations\r\nGrammar, Vocabulary, and Pronunciation Training\r\nFrench for Business and Professional Needs\r\nDELF/DALF Exam Preparation\r\nFrench for Travelers\r\nLet’s make your French learning journey enjoyable and effective. Start today and bring the French language into your life!',	0.00,	'',	NULL,	NULL,	'$2y$10$9LQlmGjiOl0F9OZSHn3ZnutjFEtA2/DXzY.dJ5A.QZ4QiAn088fjy',	'1-9Nbq8vLobfMQXTidriMA.jpg',	NULL,	0.0000000,	0.0000000,	0,	'',	'',	NULL,	0.00,	NULL,	NULL,	NULL,	NULL,	1,	1,	NULL,	NULL,	'2024-10-28 19:15:19',	'2024-10-28 19:15:19'),
                                                                                                                                                                                                                                                                                                                                                                                                                              (1961,	39,	'Cristian Dabu',	NULL,	1,	'cris1@gmail.com',	'My name is Cristian Dabu, and I’m here to make learning Japanese an exciting experience. With a decade of teaching experience, I’ve developed a supportive and effective approach to learning Japanese at any level.\r\nQualifications:\r\nMaster’s Degree in Japanese Language and Culture\r\nJLPT Certified Instructor\r\nWhy Learn Japanese with Me?\r\nBroad Expertise: Taught over 450 students from 30+ countries\r\nPersonalized Instruction: Designed 650+ custom lessons based on each student’s goals\r\nHigh Achievement Rate: 85% of my students reach their Japanese language targets\r\nPortfolio Highlights:\r\nCombined traditional and interactive methods with 200+ multimedia resources\r\nSupported 75% of students in achieving high scores on the JLPT\r\nCreated a comprehensive resource library with 300+ video lessons, practice quizzes, and exercises\r\nMy Service Offerings:\r\nTailored Japanese Language Lessons\r\nConversational Practice for Everyday Use\r\nKanji, Grammar, and Vocabulary Building\r\nJapanese for Business and Professional Use\r\nJLPT Exam Preparation\r\nJapanese Language and Culture for Travelers\r\nTogether we can explore the language and culture of Japan. I’m here to help you achieve your goals. Let’s start this learning journey together!',	0.00,	'',	NULL,	NULL,	'$2y$10$Gba/8HrYNwRjA78lXVHHpOT0bMrMbGyhDU3qNfRkp4e1sUlmdU1na',	'1-HDkGeDIlYQSqtoiKHXz4.jpg',	NULL,	0.0000000,	0.0000000,	0,	'',	'',	NULL,	0.00,	NULL,	NULL,	NULL,	NULL,	1,	1,	NULL,	NULL,	'2024-10-28 19:16:02',	'2024-10-28 19:16:03'),
