                                                                                                                                                                                                                                                                                                                                                                                                                              (1963,	31,	'Daniela Ristea',	NULL,	2,	'danio@gmail.com',	'I’m Daniela Ristea, your guide to speaking Spanish with ease. With a decade of teaching experience, I’m here to help you build language skills that are useful, enjoyable, and practical.\r\nQualifications:\r\nBachelor’s Degree in Spanish Language and Culture\r\nCertified Spanish Language Educator\r\nWhy Work with Me?\r\nExtensive Experience: Successfully trained over 500 students from 40 countries\r\nUnique Teaching Plans: Crafted 700+ custom lesson plans tailored to individual goals\r\nGoal-Oriented Learning: 90% of my students reach or exceed their language targets\r\nPortfolio Highlights:\r\nIntegrated both traditional and digital tools, utilizing 180+ multimedia resources\r\nSupported 80% of students in passing the DELE exam with excellent scores\r\nDeveloped a library of 350+ interactive video lessons, exercises, and language quizzes\r\nWhat’s Included in My Services:\r\nCustomized Spanish Language Lessons\r\nPractical Conversation Practice\r\nGrammar, Vocabulary, and Accent Coaching\r\nSpanish for Business and Professional Use\r\nDELE Exam Preparation\r\nSpanish for Travel Enthusiasts\r\nIf you’re ready to dive into the Spanish-speaking world, I’m here to guide you. Let’s make your journey to fluency enjoyable and rewarding!',	0.00,	'',	NULL,	NULL,	'$2y$10$7NsWZOtKfjg4iXTUlgi7IuT0mAYEJoP2kiWwN2l.ezpNbd8/zLKRm',	'1-iHZWg6kCaONqSMkB0HI1.jpg',	NULL,	0.0000000,	0.0000000,	0,	'',	'',	NULL,	0.00,	NULL,	NULL,	NULL,	NULL,	1,	1,	NULL,	NULL,	'2024-10-28 19:18:14',	'2024-10-28 19:18:14'),
