                                                                                                                                                                                                                                                                                                                                                                                                                              (1965,	29,	'Sam Oloughlin',	'',	1,	'Samoloughlin@gmail.com',	'Right now, mastering English opens doors to endless opportunities. I’m Sam, an English Teacher dedicated to helping students of all ages and backgrounds improve their language skills with confidence. My focus is on creating engaging, supportive lessons tailored to each student’s needs, blending traditional and modern methods to ensure practical and enjoyable learning.\r\nWhy Me: I combine patience and expertise, empowering students to build language skills that are relevant, useful, and immediately applicable.\r\nTeaching Techniques: Grammar Mastery, Conversational Practice, Cultural Context Integration\r\nCertifications: TEFL Certified, Bachelor’s in English Language and Literature\r\nServices:\r\nPrivate Tutoring: One-on-one sessions focused on individual goals.\r\nExam Preparation: Structured practice for IELTS, TOEFL, and more.\r\nConversational English Classes: Fun, interactive classes to boost confidence.',	0.00,	'',	NULL,	NULL,	'$2y$10$/n05ABf5qbyGR4Q1chOK2.wkVnIjlh4o5qh7Fe5JqwMUGaUxzgLtG',	'1-qpCyP15rBveWul8dxItL.jpg',	NULL,	0.0000000,	0.0000000,	56,	'',	'',	'',	0.00,	'',	NULL,	NULL,	NULL,	1,	1,	NULL,	NULL,	'2024-11-01 17:09:04',	'2024-11-01 17:09:41'),
                                                                                                                                                                                                                                                                                                                                                                                                                              (1966,	37,	'Vera Khvastunova',	NULL,	2,	'verakhvastunova@gmail.com',	'Learning Czech can open a window into a rich culture and heritage. I’m Vera, a Czech Teacher passionate about making this unique language accessible and enjoyable for learners at any level. My approach involves an immersive experience, focusing on both language mechanics and cultural insights, to help students feel connected and confident.\r\nTeaching Techniques: \r\nVocabulary Building\r\nA structured approach to expanding vocabulary through targeted exercises and real-world examples. This technique not only introduces new words but also focuses on context and usage, ensuring students can confidently incorporate new vocabulary into their daily conversations.\r\nPronunciation Drills\r\nFocused practice sessions designed to improve pronunciation and intonation, helping students sound more natural and boosting their speaking confidence. These drills cover key sounds and nuances of the language, making communication clearer and more effective.\r\nCultural Context Lessons\r\nLanguage learning becomes richer with cultural understanding. These lessons integrate cultural insights, idioms, and expressions, providing students with a more immersive experience and a deeper connection to the language. Understanding cultural context enhances fluency and helps students navigate social interactions seamlessly.\r\n\r\nCertifications: Certified Czech Language Instructor, Master’s in Slavic Languages\r\nServices:\r\nBeginner and Advanced Classes: Customized lessons for all proficiency levels.\r\nLanguage Immersion Sessions: In-depth practice to accelerate fluency.\r\nCultural Workshops: Insight into Czech culture, history, and traditions.',	0.00,	'',	NULL,	NULL,	'$2y$10$uHSFmizdX3dbzVzrzJ7flO4M/bTul8wRVi/cSvB5dxFJ/AOk5Fhx.',	'1-oLkEHSuIe0pphrDPAvsp.jpg',	NULL,	0.0000000,	0.0000000,	0,	'',	'',	NULL,	0.00,	NULL,	NULL,	NULL,	NULL,	1,	1,	NULL,	NULL,	'2024-11-01 17:11:57',	'2024-11-01 17:11:57'),
