INSERT INTO `user_categories_translations` (`user_category_id`, `language_id`, `name`, `text`, `title`, `keyword`, `description`, `created_at`, `updated_at`) VALUES
                                                                                                                                                                  (29,	1,	'English Teachers',	'<div style=\"text-align: justify;\">In the contemporary world, the importance of English cannot be overstated. It has emerged as the quintessential global language, a key to unlocking opportunities and accessing information across various domains. Its dominance in international business, science, technology, and entertainment, coupled with its role as a primary or secondary language in many countries, has solidified its status as a lingua franca for people worldwide.  It\'s not just a language of communication, it\'s a medium through which we access the vast expanse of human knowledge, engage with diverse cultures, and participate in the global economy.</div>',	'English Teacher',	'English Teacher',	'English Teacher',	'2024-02-28 11:39:33',	'2024-03-11 00:20:38'),
                                                                                                                                                                  (30,	1,	'German Teachers',	'<div style=\"text-align: justify;\">German, with its rich history and cultural depth, is a language that commands respect and fascination in the global linguistic landscape. Spoken by over 130 million people worldwide, it holds the status of being the most widely spoken native language within the European Union and enjoys official language status in Germany, Austria, Switzerland, Luxembourg, and Liechtenstein. Learning German not only facilitates access to the wealth of knowledge and innovation in German-speaking countries but also fosters a deeper understanding of Europe\'s cultural diversity.</div>',	'German Teacher',	'German Teacher',	'German Teacher',	'2024-02-28 11:40:23',	'2024-03-11 00:19:45'),
(31,	1,	'Spanish Teachers',	'<p style=\"text-align: justify;\">Today, Spanish\'s relevance extends beyond its linguistic boundaries into pop culture, music, and cuisine, making it a language of daily life and entertainment for millions worldwide. Its status as an official language of the United Nations and the European Union further cements its role in international affairs and diplomacy. In essence, Spanish is more than a language, it\'s a window into a diverse and dynamic world that spans continents and centuries. Learning Spanish opens doors to exploring rich cultural landscapes, engaging with global markets, and participating in international dialogues, making it an invaluable asset in our interconnected world.</p>',	'Spanish Teachers',	'Spanish Teachers',	'Spanish Teachers',	'2024-02-28 11:43:58',	'2024-03-11 00:31:32'),
(32,	1,	'Italian Teachers',	'Italian is often described as the language of music. It is the language of opera, with its origins in the Italian Renaissance, and many musical terms used globally are Italian, from \"piano\" and \"forte\" to \"allegro\" and \"adagio.\" Italian maintains its relevance through Italy\'s economic contributions to the European Union and the global market, especially in the manufacturing, automotive, and design sectors. Learning Italian not only facilitates business ventures in these industries but also enriches travel experiences, allowing for authentic interactions and exploration of Italy\'s storied landscapes.',	'Italian Teachers',	'Italian Teachers',	'Italian Teachers',	'2024-02-28 11:44:55',	'2024-03-11 09:37:47'),
                                                                                                                                                                   (33,	1,	'French Teachers',	'<div style=\"text-align: justify;\">French\'s role as a working language of the United Nations, the European Union, and numerous other international organizations underscores its importance in diplomacy and global governance. It is a language of official communication and negotiation, facilitating international cooperation and policy-making. French connects learners to a vast and diverse world of artistic, intellectual, and culinary traditions, making it an enduringly valuable language to learn and cherish.  Learning French not only enhances professional opportunities but also enriches personal experiences, allowing for deeper engagement with Francophone cultures around the world.</div>',	'French Teachers',	'French Teachers',	'French Teachers',	'2024-02-28 12:34:45',	'2024-03-11 09:46:03'),
(34,	1,	'Portuguese Teachers',	'<div style=\"text-align: justify;\">Portuguese, a language of exploration, culture, and global communication, stands as the sixth most spoken language in the world, with over 260 million speakers spread across four continents. Its importance is derived from its historical legacy, cultural richness, and growing influence in international business, diplomacy, and media. In today\'s interconnected world, Portuguese continues to grow in importance, facilitated by the digital age. The language\'s presence in online content, social media, and international broadcasting expands its global reach. </div>',	'Portuguese Teachers',	'Portuguese Teachers',	'Portuguese Teachers',	'2024-02-28 12:35:38',	'2024-03-11 09:50:43'),
(35,	1,	'Chinese Teachers',	'<div style=\"text-align: justify;\">Learning Chinese is increasingly important in the global business landscape. China\'s pivotal role in international trade, manufacturing, and technology innovation makes Mandarin an invaluable asset for professionals engaging with Chinese companies or working in China. Mandarin Chinese is more than a language; it\'s a key to understanding one of the world\'s oldest civilizations and its modern manifestations. Learning Chinese opens up vast opportunities for cultural exchange, business, diplomacy, and personal growth, making it an invaluable language in the 21st century\'s globalized world.</div>',	'Chinese Teachers',	'Chinese Teachers',	'Chinese Teachers',	'2024-02-28 12:36:13',	'2024-03-11 10:06:40'),
                                                                                                                                                                    (36,	1,	'Polish Teachers',	NULL,	'Polish Teachers',	'Polish Teachers',	'Polish Teachers',	'2024-02-28 12:36:42',	'2024-03-05 14:28:45'),
